DROP TABLE IF EXISTS `fke_collect_statistics`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fke_collect_statistics` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `key_name` varchar(32) DEFAULT NULL,
  `key_name_crc32` int(11) unsigned DEFAULT '0',
  `type_id` tinyint(4) DEFAULT '0' COMMENT '1出租  2出售 3求租 4求购 5新闻',
  `column_type` tinyint(4) DEFAULT '0' COMMENT '1住宅 2写字楼 3商铺',
  `source_id` int(11) unsigned DEFAULT '0' COMMENT '来源ID',
  `city_website_id` int(11) unsigned DEFAULT '0' COMMENT '城市分站ID',
  `last_id` int(11) unsigned DEFAULT '0' COMMENT '最新信息ID',
  `mtype` tinyint(4) DEFAULT '0' COMMENT '房源发布人类型1经纪人 2个人用户',
  `updated` int(11) unsigned DEFAULT '0' COMMENT '最新信息添加时间',
  PRIMARY KEY (`id`),
  KEY `key_name_crc32` (`key_name_crc32`)
) ENGINE=InnoDB AUTO_INCREMENT=14855 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

