INSERT INTO `fke_housesell_extend` VALUES (15783300,'','','','https://xa.ke.com/ershoufang/101118128321.html',0,'','','',''),(15783301,'','','','https://xa.ke.com/ershoufang/101118128260.html',0,'','','',''),(15783302,'','','','https://xa.ke.com/ershoufang/101118128214.html',0,'','','',''),(15783303,'','','','https://xa.ke.com/ershoufang/101118128140.html',0,'','','','<div class=\"baseattribute clear\">            <div class=\"name\">核心卖点</div>            <div class=\"content\">              业主诚心出售，户型方正，四号线地铁口含元殿 精装            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">户型介绍</div>            <div class=\"content\">              ：三室南北，采光好，此房满三满二 房证在手， 可以随时交易..............            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">周边配套</div>            <div class=\"content\">              商场：华润万家、大家润农贸市场、东方美居国际建材广场、大明宫建材家具城医院：唐城医院、大华医院、西京医院、四医大口腔医院、陕西中西医结合医院、西安市第二医院            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">交通出行</div>            <div class=\"content\">              16路、17路、22路、38路、46路、104路、209路、216路、262路、263路、309路、409路、517路、703路、707路、801路、913路公交车至含元路口站下车向东100米，地铁四号线含元殿站，三号线石家街站房主自荐(业主对房源的描述)            </div>          </div>'),(15783304,'','','','https://cd.ke.com/ershoufang/106113655252.html',0,'','','','<div class=\"baseattribute clear\">            <div class=\"name\">核心卖点</div>            <div class=\"content\">              天府名居套三单卫，带入户花园，户型方正，位置楼层安静。            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">小区介绍</div>            <div class=\"content\">              该小区是2006年建成的，小区共八栋，分为2梯6户和2梯4户。有地下，地上停车场。24小时安保巡逻，进出小区须刷卡进出。            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">周边配套</div>            <div class=\"content\">              九方购物，特拉克斯国际广场，南熙里，交子公园，成都市一人民医院等            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">交通出行</div>            <div class=\"content\">              天府名居位于三横四纵交通网络，府城大道贯穿红星路南延线，天府大道，益州大道，剑南大道。小区北门有社区巴士1058到高新地铁站，小区背后有公交站，到成都各个方向的公交都有以及地铁30号线一期在建，出行方便。            </div>          </div>'),(15783305,'','','','https://cd.ke.com/ershoufang/106113655250.html',0,'','','',''),(15783306,'','','','https://cd.ke.com/ershoufang/106113655062.html',0,'','','',''),(15783307,'','','','https://cd.ke.com/ershoufang/106113654988.html',0,'','','',''),(15783308,'','','','https://cd.ke.com/ershoufang/106113654845.html',0,'','','','<div class=\"tags clear\">          <div class=\"name\">房源特色</div>          <div class=\"content\">                                                                                      VR房源                                                                                                                                        随时看房                                                                        </div>        </div>                              <div class=\"baseattribute clear\">            <div class=\"name\">核心卖点</div>            <div class=\"content\">              房子是开发商精装修，围合式小区，环境优美            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">税费解析</div>            <div class=\"content\">              房子是商品房，不满五年税费有，增 值税及附加5.3%，满五年没有增 值税，满五唯一省个税，不唯一，个税1%,契税90平以下首套1%,二套1.5%，90平以上首套1.5%，二套是2%            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">交通出行</div>            <div class=\"content\">              该小区的轨道交通地铁一号线广福地铁口直线距离900米左右，出小区上沈阳路可以直接上天府大道，小区门口就是公交站，大型商场，红星美凯龙生活美学中 餐饮，电影院，K TV全带，出小区就是锦江生态带，环境优美舒适            </div>          </div>'),(15783309,'','','','https://cd.ke.com/ershoufang/106113654813.html',0,'','','',''),(15783310,'','','','https://cd.ke.com/ershoufang/106113654384.html',0,'','','',''),(15783311,'','','','https://cd.ke.com/ershoufang/106113654379.html',0,'','','','<div class=\"tags clear\">          <div class=\"name\">房源特色</div>          <div class=\"content\">                                                                                      VR房源                                                                        </div>        </div>                              <div class=\"baseattribute clear\">            <div class=\"name\">核心卖点</div>            <div class=\"content\">              户型方正，配套齐全， 地理位置有优势，中间楼层            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">小区介绍</div>            <div class=\"content\">              开发商：成都市聚业房地产开发有限公司，修建于2017年。物业公司：成都联邦信合物业管理有限责任公司，物业费1.4元。小区为高层加洋房的设计，绿化高，楼间距大。适合居住            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">适宜人群</div>            <div class=\"content\">              小区环境好，到凤凰湖湿地公园近，电梯房，到家乐福，永辉 。适合各年龄段人口居住            </div>          </div>                  <div class=\"baseattribute clear\">            <div class=\"name\">交通出行</div>            <div class=\"content\">              自驾可走成青快速通道，成绵高速，2023年可以走成绵附二线到成都市，也有高铁出行方便。青白江公交路线：Q2、Q50、Q53、Q51、Q5、Q56、Q16、Q20、Q13、Q17。出行方便            </div>          </div>'),(15783312,'','','','https://qd.ke.com/ershoufang/103124616025.html',0,'','','',''),(15783313,'','','','https://qd.ke.com/ershoufang/103124615889.html',0,'','','',''),(15783314,'','','','https://qd.ke.com/ershoufang/103124615822.html',0,'','','',''),(15783315,'','','','https://qd.ke.com/ershoufang/103124615700.html',0,'','','',''),(15783316,'','','','https://qd.58.com/fangchan/53413813464473x.shtml',0,'','','','准拆迁房，位置是即墨东山前小区，村里已经拆迁，村已经拆迁，村里的房子在建设中，因家里有急事需要钱，二楼套二72平方米，南北通透，加车库28平方米，特此出售，必须全款，非诚勿扰！有证的子，可以到村里更名。放心购买'),(15783317,'','','','https://qd.ke.com/ershoufang/103124615626.html',0,'','','',''),(15783318,'','','','https://qd.ke.com/ershoufang/103124615621.html',0,'','','',''),(15783319,'','','','https://qd.ke.com/ershoufang/103124615583.html',0,'','','',''),(15783320,'','','','https://qd.ke.com/ershoufang/103124615568.html',0,'','','',''),(15783321,'','','','https://sjz.58.com/fangchan/53413207743768x.shtml',0,'','','','优惠价转让，可租可售'),(15783322,'','','','https://cq.58.com/fangchan/53413943570318x.shtml',0,'','','','车位方正，位于电梯口，位置方便，目前处于出租状态，租金可观，如有有缘人购买，可随时交付使用');
