INSERT INTO `fke_news_extend` VALUES (335800,'<p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">兔年伊始，龙头房企万科继续进行人事变动。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">据21世纪经济报道记者了解，万科于近期在区域与城市层面进行了首席合伙人以及城市合伙人的换防，主要涉及南方区域、东北区域以及北京公司。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">近年来，万科区域首席合伙人以及城市总经理这两个过去能够独当一面的级别上进行了多次队形调换，主论调均是“事人匹配”“业绩论英雄”。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">而如果放在房地产行业大的发展框架之下，万科各个城市公司以及区域的业绩，不仅取决于区域及城市公司的高管，还可能由区域本身的发展情况以及万科团队对当地业务的熟悉程度而决定。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">如此频繁地调动，万科业绩能否如愿更上层楼，却并非板上钉钉。人事换防后业绩仍然原地踏步甚至倒退，这在万科过去的人事变动史上并不少见。优秀的将领能够成长起来，土壤更重要。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230202/167531180977753-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">图片来源：视觉中国</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">事人匹配</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">万科此次人事变动，总共涉及7个人。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">其中，最受关注的是万科原北京区域副总经理曾巍调任东北区域首席合伙人，原东北区域首席合伙人林曈调任北京万科总经理。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">万科方面针对此次区域的人事变动回应21世纪经济报道记者称，万科在人事安排上一直注重“事人匹配”。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">“此次安排北京区域副总经理曾巍接任东北区域首席合伙人，主要是基于东北区域业务特点和业绩难点，来选择相匹配的将领，曾巍在北方区域深耕多年，任烟台公司总经理期间业绩突出。”万科强调。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">事实上，东北万科去年业绩完成情况很好。据中指研究院统计，在2022年东北区域房地产企业销售业绩排行中，万科以191.7亿元的销售金额位列房企第一，遥遥领先。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">尽管如此，万科仍然提前预见了东北区域的业绩难点，并匹配了相应的将领。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">万科指出，曾巍在北京区域担任副总期间，协助卢冰分管营销、运营等核心板块，尤其在销售领域积累了丰富的实战经验。东北区域业务主要集中在住宅领域，虽然过去一年保持了该区域市场排名第一的地位，但后续住宅销售压力大，安排熟悉北方市场、擅长销售突破、敢打肯拼的将领担任东北区域负责人，有助于东北区域更好地应对当下挑战。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">依照万科熟悉北方市场的逻辑，林曈应该比曾巍在这一区域扎根更久。曾巍在去往北京之前，主要在万科南方城市工作，2015年调往烟台，2019年再进京。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">而林曈于2005年加入万科之后，则一直在北方城市工作，曾先后任北京公司设计部经理、北京区域本部产品策划中心总经理、沈阳公司副总经理、唐山事业部总经理、烟台公司总经理、长春公司总经理、沈阳公司总经理。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">对于林曈的调任，万科表示，“北京公司作为集团业务重镇之一，复杂度和难度很大，对将领的成熟度有更高的要求，过往由北京区域首席合伙人卢冰兼任北京公司总经理，此次安排林曈调任北京公司总经理，主要是希望补充北京团队力量。林曈有着丰富的运营管理经验，公司希望北京公司未来能有更好的业绩表现。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">业绩突围</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">万科此番人事变动，在城市层面上则主要集中于南方区域。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">其中，原佛山万科总经理黄运林调任北京区域公司合伙人，原厦门万科总经理常乐调任佛山万科总经理，原南方区域产城事业部首席合伙人、总经理高骏调任厦门万科总经理，原南方区域合伙人陈致中调任惠州万科总经理，原惠州万科总经理刘健华调任东莞公司合伙人。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">这几座换将的城市在万科内部业绩表现均不算太理想。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">据克而瑞统计显示，2022年万科在厦门销售排名仅位列15位，成交金额12.78亿元；当年佛山万科则实现权益销售额59亿元，排名第5；而根据惠州中原统计，万科以17.95亿元销售额位列第八。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">厦门、东莞和惠州，均受累于万科过去的投资失误。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">2018年，厦门万科白鹭郡因“半价卖房”引发舆论关注，尽管万科后来否认并未有这种情形出现，但也折射出厦门万科业绩承压的不争事实。随后，厦门万科业绩一落千丈，从2018年的排名前三滑落至2022年的第15名。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">佛山万科的情况也与之类似。佛山万科曾于2017年拿下一宗70年全自持地块，而后于2021年退地，这宗地块的曲折走向，也是万科错判形势的写照。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">这些城市公司的业绩表现，最终拖累了万科。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">去年，万科发布的2021年年报中，其当年全年归母净利润为225.24亿元，同比下滑45.75%。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">万科董事会主席郁亮为此做了检讨，他表示，“万科过去一直是充分授权、分布式的特点，但随着竞争越来越激烈，大型复杂项目越来越多，单一城市公司和单一区域，不具备完整能力，这就会表现出参差不齐和离散度大的问题，部分项目不及预期，拉低了整体表现，诸如项目操盘能力分化，少数项目出现投资失误。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">为此，万科设立了开发经营本部，此后通过统筹管理，万科所有的项目从拿地、投资、产策、设计、工程建造等环节，都能够把集团的力量拉通。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">郁亮其时还承诺，万科2022年业绩将实现企稳回升。市场也一度对此抱有信心。在2022年年中业绩发布后，一位长期关注万科的地产分析师对21世纪经济报道记者分析认为，“万科2022年净利润乐观预计可以有10%左右的增长，因为去年（2021年）基数太低了。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">但是2022年包括保利发展、招商蛇口等业绩纷纷表现不佳的情况下，上述地产分析师意见转趋保守。“现在这样的情况，我觉得有增长就算不错了。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">郁亮去年立下承诺之时，对行业不乏期许，但过去一年的市场表现，并不遂人愿。业绩企稳回升的承诺，郁亮还能兑现否？</p><p><br/></p>'),(335801,'<p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">新春伊始，全国多省市密集召开“新春第一会”，部署全年经济发展工作。其中，“提振住房消费”成为多地扩内需的发力重点。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">据国金证券统计，截至1月30日，全国31个省份中已有23个召开“新春第一会”，其中江苏、辽宁、上海、天津、广东、河南、云南、内蒙古8个省份发布政府工作“一号文件”。除天津外，其余7个在“一号文件”中均提出支持住房需求改善的相关内容。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">中央层面，春节假期后首个工作日召开的国务院常务会议，针对需求不足的突出矛盾，乘势推动消费加快恢复成为经济主拉动力，强调“合理增加消费信贷。因城施策用好政策工具箱，支持刚性和改善性住房需求，做好保交楼工作”。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">近一周以来，各地“因城施策”，加快落实各类降成本措施。目前，已有包括郑州、珠海、天津、福州等核心二线城市在内的近20城，将首套房贷利率下限降至4%以下。此外，也有如济宁、长沙等城市，相继从放宽首套房认定标准、下调二套房的首付比例等方面，加大对改善型住房需求的信贷支持。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">多名业界人士认为，尽管目前中央和地方边际放松房地产需求调控的政策迭出，但在大部分城市的经济环境以及房价预期仍较弱的背景下，市场修复需要更长时间。“在住房需求旺盛的一二线城市，有望率先迎来市场复苏，楼市‘小阳春’或将在少数城市出现。从全国来看，预计整体市场最早将于二季度企稳。”中指研究院指数事业部市场研究总监陈文静称。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">多地支持住房改善</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">进入2023年，为更有效地激活住房消费，多地对购买力较高、购房需求更坚挺的改善型购房群体给予更多关注。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230202/167531190119284-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">据第一财经不完全梳理，截至2月1日，在重庆、河南、江苏、辽宁、广东等省份以及上海、深圳、昆明、济源等地区陆续召开的区域住建工作会议或稳经济会议中，或在当地发布的相关文件中，均明确提出，鼓励改善型住房消费。不过，因为楼市阶段性特征不同，热点和非热点地区在具体做法上有所差异。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">其中，在房价高企的经济大省和热点城市，当地政府不约而同地将政策重点放在废除不合理的限制性政策和降低换房门槛上。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">比如，苏州市1月31日出台《关于推动经济运行率先整体好转的若干政策措施》，提出因城施策用足用好房地产调控政策工具箱，调整优化限制性政策和土地出让政策，大力支持刚性和改善性购房需求，坚持“房住不炒”，认真落实居民个人换购住房个人所得税政策。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">记者注意到，在1月中旬江苏省政府印发的《关于推动经济运行率先整体好转若干政策措施》中，亦然相同表述。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">广东1月28日召开的高质量发展大会提出，今年将大力促进住房消费。因城施策实施好差别化住房信贷政策，积极支持刚性和改善性住房需求，为以旧换新、以小换大、生育多子女家庭住房消费提供便利。按规定落实个人购买住房契税及换购住房个人所得税优惠政策。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">另据重庆市政府1月初发布的“稳经济政策包”，涉及房地产领域的27条举措中，多项内容与改善型购房有关。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">具体包括：调整全市差别化住房信贷政策，二套住房商业性个人住房贷款利率下限调整为不低于相应期限贷款市场报价利率加60个基点；落实差别化房地产税收政策，家庭新购住房，在办理不动产权证前转让家庭唯一原住房的，按照第一套住房享受契税优惠政策；优化商业贷款住房套数认定。居民在中心城区以外区县新购住房的，个人住房商业贷款仅将所在区县的住房纳入套数核查范围等。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">支持“先买新再卖旧”，也是重庆市鼓励当地家庭购置改善性住房的举措之一。根据上述稳经济政策包，对拟出售家庭唯一住房的，房地产企业可延长认购期，支持其出售原住房；对已网签出售的家庭唯一住房，可不纳入住房贷款套数核查范围。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">重庆之外，截至目前，广州、深圳、武汉和浙江等多地商业银行也推出了“带押过户”业务，以激活当地“卖一买一”的换房需求。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">而在非热点和低能级城市，由于当地居民购买力有限，多地政府将“激活改善型住房市场”的落脚点放在了市外购房需求上。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">比如，1月20日，昆明发布《关于加快推动经济回稳向好的若干政策措施》，明确支持房地产企业开展市域外营销，提升新建小区优质医疗、教育资源配套水平，吸引省内外中高端购房群体加快回流。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">也有楼市遇冷的地区为改善型购房者发放购房补贴。根据河南济源示范区1月19日印发的《2023年大力提振市场信心促进经济稳定向好政策措施》，在政策出台至2023年4月30日期间，对购买（以合同备案时间为准）新建商品住宅，建筑面积144平方米以上（含144平方米）户型的，给予15000元/套补贴。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">居民愿意换房、再置业了吗？</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">去年下半年以来，除个别城市外，多数城市的限贷政策已逐步放宽，一些二线城市主城区和一线城市部分非核心区域的限购政策亦得到调整，但这些政策效果并不显著。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">进入2023年，地方政府继续“因城施策”地取消不合时宜的购房资格限制性政策。与此同时，多地开始聚焦于从信贷等政策入手，增加改善型购房者的消费能力。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">在农历春节之后，核心二线城市降成本措施传导加快。其中，郑州、沈阳、厦门、福州、珠海、天津等符合房贷利率下调要求的城市，相继将首套房贷利率下限降至4%以下，进入“3”阶段；也有城市在二套房认定、贷款首付比例上做出调整。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">以湖南为例，1月31日，当地召开2022年金融运行形势新闻发布会，会议提出合理确定各市州个人住房贷款首付比下限。目前，全省13个非限购市州的首付比下限均降至首套20%、二套30%；1个限购市（长沙市）的首付比政策下限首套30%、二套降至40%。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">此前，长沙执行的首付比例为，对在限购区域内购买商品住房申请商业性个人住房贷款的购房家庭：拥有1套住房且相应贷款未结清的户籍家庭购买第二套商品住房，首付比例不低于45%。此次新政后，长沙二套房首付比例有所下降。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">除了商业贷款外，公积金贷款政策也是地方政府发力的方向。比如，根据山东省济宁市住房公积金管理中心发布《关于调整住房公积金个人住房贷款部分政策的通知》，首套房公积金贷款最低首付款比例调整为20%，二套房公积金贷款最低首付款比例调整为30%。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">信贷政策持续优化之下，一些有购买力的观望者开始酝酿购房计划，但也有观望者选择暂缓入市。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">“确实遇到了一些观望已久、有迫切换房需求的家庭近期又开始看房了。”一名天津某头部房产中介公司的销售人员2月1日对记者表示，目前，当地首套房贷利率可以做到3.9％。房贷成本的降低，叠加部分商业银行推出了“带押过户”政策，缩短一二手房交易时间，一些换房年轻夫妇考虑先将手头的一套房产转给父母，再以首套利率置换新房。“整个置换流程，大概半个月就能走完。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">不过，武汉光谷片区某房产中介小王则对第一财经记者表示，目前，在当地开始有购买二套房或者换房打算的客源依然寥寥。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">据他介绍，去年下半年以来，当地多项楼市利好政策已密集释放。比如，武汉首套商贷利率已在去年年底降到了3.9％。在光谷等热门片区，由于处于二环外，近期又被调整为非限购地区，意味着首套房首付比为二成。但即便如此，市场依然没有掀起太多波澜。“一些近期交付的楼盘，质量问题堪忧；此外，从房价一直看涨到房价跌跌不休，购房者心态变了。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">在中国城市经济学会房地产专委会主任、中国区域科学协会副理事长王业强看来，当前，部分刚需和首改群体仍持观望态度的背后，可能存在多层次的原因，如房企爆雷、烂尾问题引起的购房信心不足问题，又如受疫情冲击、收入下降影响，购房的支付能力不足等。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">“解决的措施应重点关注如何进一步优化调控措施，以恢复市场信心。同时，各地要积极响应中央促进住房消费的政策，继续扩大对置换改善购房群体的金融信贷支持。”王业强称。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">而中国首席经济学家论坛研究院院长、中国人民银行调统司原司长盛松成则认为，楼市不仅需要研究房地产领域的政策措施，也应与我国宏观调控政策相结合，尤其是在当前经济下行的背景下。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">对此，他近日在第一财经撰文称，积极的财政政策应更多向民生领域倾斜，并着力促进内需增加，缩短经济实现内生增长的时间，这是改善居民预期和提高收入的根本途径。同时，房地产领域仍应保持政策定力，在坚持“房住不炒”的同时，继续帮助行业度过困难期，但要避免过度刺激市场。此外，还应增加与市场的政策沟通，对未来我国房地产转型方向提供更加明确的指引，这也有助于缓和市场的观望情绪。</p><p><br/></p>'),(335802,'<p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167538692463916-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">冰川思想库研究员丨关不羽</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">2023年，房地产重回“支柱产业”行列，又打开了想象的空间。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">“乐观派”的理由是三大利好：政策放宽、经济复苏和货币宽松。尤其是货币宽松的预期如此强烈，以至于有人预言超一线的房价今年还能涨个二到三成，“每平30万可期”。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">真让人感叹“今夕何夕，见此良人”。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">01</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">滞胀是新风险</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">“一直放水一直涨”的错觉，还在经济高速增长期的旧梦中。要是印钞就能高楼平地起，那全世界到处都是“宇宙中心”了。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">高通胀、高增长、高房价的“三高”已经是老黄历了，目前主要风险不是通胀，而是滞胀。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">1月17日，在国务院新闻办举行的2022年国民经济运行情况新闻发布会上，国家统计局局长康义称：</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">当前国际环境仍然在复杂演变，世界经济增长动能在趋缓，全球贸易形势不容乐观，世界经济可能面临滞胀局面。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">全球同此寒凉，谁能独善其身？</span>所谓滞胀，即停滞性通胀。货币发行量增长，但是各项经济指标停滞。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">货币好比是液压泵里的油，泵的动力不足，加了很多油。一开始效果不错，动力上来了。可是加了几回后，发现加油也没动力了。一种可能是油加多了，漏掉了。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">还有一种可能是这个泵本来就有毛病，靠加油能掩盖住了，拖到毛病越来越大，再加油也不行了。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167538692472760-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/><em class=\"desc\" style=\"color: rgb(155, 158, 163); line-height: 20px; text-align: center; display: block; font-size: 14px;\">图/图虫创意</em></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">长期通胀导致滞胀的原理也类似。货币注水积累了大量无效资产，就是油漏掉了。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">靠货币注水拉动经济增长，是给结构性问题开出了流动性的药方，拖延了经济结构性问题的解决，无效资产的堆积甚至加剧了结构性问题，对应的是泵坏掉了的那种情况。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">中国大规模宽松货币政策始于2008年的四万亿大基建，此后的八万亿、十二万亿，货币刺激政策力度逐轮增大，房价随之节节攀升。<span style=\"font-weight: bolder;\">因此，“放水涨房价”的观念根深蒂固。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">然而，世上哪有一直放水一直涨的好事？高通胀高增速下的楼市表现，并不适用于滞胀。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">经济滞胀的楼市表现可以参考日本，主要特征是分化。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">02</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">楼市分化后的表现</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">上世纪90年代初，日本泡沫经济崩溃直接冲击楼市，房价大跌，东京大阪房价“腰斩”，很多中小城市的房价则跌到了脚后跟。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">此后日本经济以债务货币化的方式开启滞胀模式，房价的区域分化显著。东京大阪的房价经过十几年的缓慢攀升，回到了泡沫高峰时期的80%左右，但是成交量急剧萎缩。而大部分中小城市则是房价躺平，成交量躺得更平。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">如果中国经济也进入滞胀，楼市区域分化加剧的情况也会类似。</span>与东京、大阪同一生态位的超一线城市，最终可能会进入价高量低的状态。这在微观经济也可以合理解释。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">中国超一线城市不仅具备经济优势，同时还具备日本大都市不可比拟的政治地位，公共服务水平和其他地域的优势差距更大，经济机遇更为富集。这些构成了“宇宙中心”的房价基本支撑。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">但是，大涨也是不可能的。政策放宽、经济复苏的利好因素，很难期待长期化，不可高估。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167538692415807-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/><em class=\"desc\" style=\"color: rgb(155, 158, 163); line-height: 20px; text-align: center; display: block; font-size: 14px;\">图/图虫创意</em></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">参考其他主要世界经济体的后疫情经济，反弹的力度和持续时间均低于预期，疫情期间各国央妈搞超宽松货币政策造成的经济内伤超乎想象。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">至于政策利好，效果也是有限。</span>政策鼓励购房，也不可能“按着牛吃草”。个人购房最重要的经济考量，是收入增长预期。没有就业稳定和收入增长的稳定预期，谁敢背二三十年的按揭呢？</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">经济增速放缓，经济活力下降，居民失去收入增长预期。房子这样的“大物件”就很难流通，势必造成成交量下降，也就失去了价格快速上升的动力。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">那么，日本进入滞胀期之前的“主动戳泡沫”会不会在2023年的中国重演，以至于大城市房价腰斩呢？</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">这种可能性也不大。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">日本当年泡沫经济崩溃本来也不是“主动戳破泡沫”，而是官僚部门政策不协调的结果，是大幅升息迎头撞上房地产税的车祸现场。有日本血淋淋的教训在前，此后各国都避免出现这样的政策失误。<span style=\"font-weight: bolder;\">目前，我国政府的政策定调稳楼市的定调是清晰的。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">因此，2023年中国超一线城市的房价可能会有一些市场波动，涨涨跌跌都有可能，但是幅度不会很大。大涨两三成的美梦还是早醒早好。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">03</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">楼市的高风险区</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">比起超一线的“宇宙中心”房价，更值得忧虑的是三线以下的楼市。那些地区的房子是白菜价，却是泡沫的高风险区。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">社会大众对资产泡沫普遍存在“价格误解”，总是以为价格高低是衡量泡沫的指标，实则不然。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">泡沫是价格和价值的背离，反映在市场层面就是名义价格和真实交易价格的背离。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">500元一克的黄金没泡沫，但是标价50块钱一把的小葱，泡沫含量爆表。“鹤岗们”上一轮棚改带动起来的房地产热，就是50块钱一把的小葱。<span style=\"font-weight: bolder;\">这些才是中国楼市的隐藏雷点。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">判断泡沫风险的大小，还要考虑存量规模。比如说，上海市中心老洋房动辄上亿，但是总共也就那么一两百栋，挂牌的只有一两栋，有足够的稀缺性。而三线以下的“草根盘”，单价虽低，盘子却不小，严重过剩。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">比如，去年石门县县委书记鼓励公务员买房，“买了一套买两套，买了两套买三套，买了三套买四套”的雷人雷语背后，就是过剩的房子。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167538692595586-17-0.png\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/><em class=\"desc\" style=\"color: rgb(155, 158, 163); line-height: 20px; text-align: center; display: block; font-size: 14px;\">图/网络</em></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">石门县50余万人口，在售楼盘多达二十多个。2021年全年，竣工住宅35.13万平方米，增长173.9%。而商品房销售面积58.25万平方米，下降13.2%。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">就这房地产规模、增长速度和销售速度的夸张差距，难怪要号召“买了三套买四套”。四套都嫌少，七八套才行。卖不完的存量，石门县的楼市泡沫含量有多高？</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">上一轮房地产下沉热潮，“激活”了很多地区的房地产，热火朝天的景象却是自拉自唱的“土地金融游戏”。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">比如，城投债处置被围观的遵义市，最大的房地产开发商是市属国有企业的遵义市投资（集团）有限责任公司。2021年数据显示，这家城投公司累计土地储备超4400亩，号称总资产高达670亿元。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">遵义市的开发商排名靠前的，几乎都是省内企业。这种地方政府主导的“土地流转内循环”搞出来的楼市，能有多少价值支撑，可想而知。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">总之，上一轮房地产下沉式开发的特点是：大量资金通过地方政府融资平台涌入，不顾当地市场的实际需求，大规模集中开发。在开发阶段完成了资金的金融闭环，但是市场销售却闭不了环。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">这些严重过剩的房子，不管建完没建完，或多或少都是经济意义的烂尾楼。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167538692584574-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/><em class=\"desc\" style=\"color: rgb(155, 158, 163); line-height: 20px; text-align: center; display: block; font-size: 14px;\">▲遵义市新蒲新区（图/图虫创意）</em></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">2023年，这些过剩的房子，将何去何从？</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">地方政府托市，指望不上。</span>即便地方公务员“买了一套买两套，买了两套买三套，买了三套买四套”，也解决不了任何问题。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">因为地方财政因债务压力吃紧，地方公务员的收入势必受到影响，一套靠积蓄，二套三套靠按揭，拿什么还呢？</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">财政脆弱、靠转移支付的地方折腾出的楼市，大概率就是泡沫堆。财政脆弱，多半本地经济不振，所谓楼市，本来就没有真正的“市”。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">因此，就算地方政府有心托市，也难以回天。即便靠政府指导价等行政干预手段强行锁住名义价格，也很难彻底解决背后的债务危机。单单靠行政干预，总有捂不住盖子的那一天。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">04</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">2023年中国楼市注定不平静</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">总之，中国楼市的2023年注定是不平静的。到底是暗潮涌动，还是惊涛骇浪，政策调理的技术因素会起一定作用。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">但是，从“政策市”回归正常市场的大势不可阻挡，<span style=\"font-weight: bolder;\">“政策信仰”、“货币信仰”支撑的“房价永远涨”难以为继。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">那些经济薄弱、寅吃卯粮的地区，本不具备房地产大发展的基础条件，拔苗助长的“催肥”不可持续。当初怎么注水的，连本带息都会还出来。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167538692569163-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/><em class=\"desc\" style=\"color: rgb(155, 158, 163); line-height: 20px; text-align: center; display: block; font-size: 14px;\">图/图虫创意</em></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">中国超一线、强一线城市也不能高枕无忧。楼市的健康度归根结底取决于市场供需关系，经济表现不佳，楼市也走不远。如果大城市不能尽快恢复经济活力，那么房价的市场支撑也很难持久。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">日本人均GDP接近4万美元，有长期耗着的本钱。中国经济最发达地区的人均GDP仅为2.7万美元左右，差距还是很明显的。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">因此，2023年对中国经济发达地区的大城市而言，是经济发力的关键窗口期。再不拼经济，楼市的“大城市信仰”将是下一块倒下的多米诺骨牌。</p><p><br/></p>'),(335803,'<p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167541615285267-17-0.png\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">北京住房公积金管理中心发布公告，自2023年2月6日起住房公积金贷款中心恢复工作日早晨8:30-9:00、中午12:00-13:30、下午17:00-17:30和周六（法定节假日除外）9:00-13:00的延时服务。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">北京住房公积金管理中心海淀管理部、中关村管理部、密云管理部、东城管理部、怀柔管理部、平谷管理部、房山管理部、西城管理部、门头沟管理部、朝阳管理部、延庆管理部、昌平管理部，也将于同日恢复延时服务。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">此前，丰台管理部、大兴管理部、通州管理部e通厅示范点、石景山管理部已经先后恢复了工作日延时服务。</p><p><br/></p>'),(335804,'<p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167541639876783-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">近日，各大城市陆续官宣了2022年的经济成绩单。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">至此，中国内地GDP30强城市排名基本见分晓。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">下面先睹为快，来看看30强城市GDP数据</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167541639894543-17-0.png\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">如上所示，2022年GDP10强城市排名已揭晓，依次为：<span style=\"font-weight: bolder;\">上海、北京、深圳、重庆、广州、苏州、成都、武汉、杭州、南京。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">01</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">哪些城市晋级了？</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">2022年GDP30强城市排名，<span style=\"font-weight: bolder;\">重庆、武汉、福州、泉州、西安</span>这5个城市排名上升了，具体如下：</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">重庆</span>超过广州，排名从第5升至第4位。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">武汉</span>超过杭州，排名从第9升至第8位。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">泉州</span>反超济南、合肥，排名从第21升至第19位。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">福州</span>反超济南和合肥，也继续超过泉州，排名从第20升至第18位。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">西安</span>反超南通、东莞，排名从第24升至第22位。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">5个晋级的城市名义增速依次为：</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">福州（8.69%）、西安（7.47%）、泉州（7.07%）、武汉（6.49%）、重庆（4.43%）。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">看完排名上升的城市，再看看2023年GDP趋势，<span style=\"font-weight: bolder;\">4万亿俱乐部仍然只有京沪两个城市，重庆、广州将冲刺GDP三万亿台阶。</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">武汉、杭州有望冲刺2万亿台阶。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">GDP在1.1万亿~1.3万亿的城市出现扎堆，有佛山、东莞、泉州这样的制造业强市，也有西安、合肥、济南、福州这样的省会城市。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">常州、烟台</span>这2个城市迈入“GDP9000亿俱乐部”，离万亿城市只有一步之遥了。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">郑州GDP数据暂未出炉，但根据媒体报道，2022年郑州GDP增速预计2%左右，也就是说2022年郑州GDP高于去年的12691亿元，大概率也会高于2022年佛山GDP（12698.39亿元），郑州大概率继续排在第16位。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">02</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">武汉与杭州的竞赛</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">值得一说的是，<span style=\"font-weight: bolder;\">从名义增速来看，TOP30城市中，增速最高的是烟台</span>，达到9.24%。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">TOP10城市中，名义增速最高的是是武汉</span>，达到6.49%，这也让武汉实现了对杭州的反超。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">其实在2020年之前，武汉的GDP排名也一度高于杭州，与成都十分接近，但因为疫情因素，武汉在2020、2021这两年被杭州反超，这一次能够重回第八城，也很不容易。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">武汉GDP之所以能反超杭州，可能与两个城市的产业结构有关，毕竟武汉第二产业占GDP比重达到35%，杭州二产比重只有30.3%。由于疫情对二产的冲击较小，所以2022年武汉经济受疫情的影响相对较小。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">不过，从民营经济以及新经济的发展水平来看，杭州显然比武汉更高。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">武汉与杭州同属于副省级城市、省会城市，一个内陆、一个沿海，人口规模差不多，确实有很多可比性，来看看武汉、杭州主要数据对比：</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167541639842097-17-0.png\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">总的来看，武汉在科教实力、人口规模、财力方面优于杭州，杭州则是民营经济更发达一些，上市公司方面显著优于武汉。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">03</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">投资额两倍于重庆，广州正在疯狂投资</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">2022年，广州GDP被重庆反超，引起一些媒体的热议。最近我看了一些2023年的投资数据，发现广州正在悄悄发力，而且力度不是一般的大。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">近期多个大城市发布2023年重大项目开工清单和年度投资额，我查询了一下部分城市的重点项目投资额</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167541639861012-17-0.png\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">如上所示，2023年<span style=\"font-weight: bolder;\">广州大项目</span>开工数量达到1722个，预计总投资额<span style=\"font-weight: bolder;\">6.6万亿</span>元，而且主要是产业投资！在主要城市中遥遥领先，是重庆的两倍之多。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">分摊到2023年的投资额也达到5260亿元，<span style=\"font-weight: bolder;\">平均每个月投资超400亿元</span>，远超重庆、武汉、成都、深圳等城市。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">这个投资额度是很吓人的，毕竟广州位于城市化率极高的大湾区，已达到后城市化阶段，投资空间不大，2023年居然在投资额上远超重庆、成都、武汉等中西部城市。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">这只能说明<span style=\"font-weight: bolder;\">广州正在火力全开、绝地反击</span>。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">同时也说明，广州作为中国第一经济大省的省会，底座是非常深厚的，只要愿意，完全可以充分发挥省会城市的优势，把投资额疯狂地拉起来。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">除了投资额，广州的新经济也正在悄悄发力，去年胡润研究院发布了《2022年中全球独角兽榜》，广州新增独角兽9家，<span style=\"font-weight: bolder;\">新增数量排名全国第一</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167541639830167-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">无独有偶，全球知名商业杂志《福布斯》近日也发布了中国内地城市2022年新晋独角兽名单，广州新增了4家独角兽，数量仅次与上海、北京深圳，排名第四。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">广州新增的4家独角兽分别是：</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">广州汽埃安（估值超1000亿元）、中芯种业（估值100亿元）、巨湾技研（估值80亿元）、如琪出行（估值80亿元）。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">从整体来看，广州独角兽公司中最厉害的是是希音（估值4000亿）和广汽埃安（估值超1000亿），其中希音还是大湾区排名第一、中国排名第三的独角兽，在全国仅次于抖音和蚂蚁集团。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">以下是胡润去年发布的广州19家独角兽企业榜，它们将引领广州新经济，在一定程度上代表着广州的未来</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230203/167541639838333-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p><br/></p>'),(335805,'<p></p><p><section><p>Garage House</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363266357-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>Shareen Joel对质朴材料、经典比例和精湛工艺的偏好在位于莫宁顿半岛的Garage House项目中也有体现。最初只是一个车库和游泳池，伴随着客户的主屋，变成了一个带有生活设施和宽敞娱乐空间的凉亭式住宅。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363214423-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>在开放式起居室、餐厅、厨房空间里，木材和藤椅围绕复古Knoll Tulip Saarinen餐桌、B&amp;B意大利公司的Tufty-Time沙发和灰色地毯上的Husk户外扶手椅。定制的赤土砖地板营造出一种原始的沿海风情，厨房架子上陈列的各种艺术品也带来别样美感。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363292105-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>为强调自然与闲适，设计师破除困难放置混凝土槽，供客户存放室内植物。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363216714-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>客户的汽车本身就是一件艺术品，因此，重点放在了车库上。小厨房后面的复古法式门，即是进入车库的入口之一。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363297318-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>车库采用了非常规的综合布局，即家具和汽车并排摆放，目的是将汽车从功能用途中分离出来，并将其呈现为近距离欣赏的装饰物。让车库从多个点进入，简化了整个体验。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363348644-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>卧室配有覆盖着木板条的墙壁，并设有Nemo Lampe De Marseille壁灯、Moroso Net边桌和Flos Piani 台灯，营造舒适之感。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363342144-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>淋浴间铺有银色zellige瓷砖，补充卧室功能之余，带来自在放松的氛围。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363333075-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>家庭活动也很容易地从室内转移到室外，室外设有游泳池、宽敞的花园和充足的栖息地，餐桌、蝴蝶椅与壁炉的配备，让居者拥有更多生活体验。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363329443-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>Armadale Residence</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363317752-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363322176-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363468573-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>在Armadale曾经是一个原始的1800年的单面维多利亚式意大利风格的别墅中，进行着一个完整的、意想不到的改造和现代化的补充。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363460225-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363457543-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363596188-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363563465-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>Shareen Joel试图引导一种精致而轻松的欧洲美学，将烟囱保留为淡粉色，翻新多年来存放的复古法式门窗，并接受其中的不完美。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363566045-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363592900-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>同时强调简单、永恒、平衡和优雅的审美，以探索性的设计，为项目保持长久的生命力与亲和力。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543363588451-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p>'),(335806,'<p></p><p><section><p>Thirteenth Beach House</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371099337-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>Thirteenth Beach House位于同一命名的郊区，用物质性来表达一种独特的精致和内省体验。由MGAO打造的庭院住宅，巧妙地平衡外部极简主义和内部亲密关系，以强调对自然的赞美。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371134026-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371155320-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>在整个海滨住宅的内部空间建立了结构化极简主义的前提。干净的边缘和尖锐的形式图案，由走廊构成的清晰、内省的后院矩形视图，带来引人注目的第一印象。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371145553-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371284977-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>MGAO通过创建一个内向的庭院式住宅来回应客户的要求，在快速发展的住宅区内为居民提供隐居感。从外观上看，这座房子覆盖着黑色的木材，从街道上看，形成了一种简单、坚实的形式。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371296068-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371261443-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>海滨住宅的现代表达方式采用了风车设计，它将公共区域和私人休憩区分开，并打造一个自然绿洲，赋予平静、安宁的氛围。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371275836-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371395270-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371351551-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>与深色、整体的外观形成鲜明对比的是，内部采用了600毫米厚的夯土墙和木材装饰板，营造温暖色调。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371433362-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371456025-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371456682-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371589414-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371585483-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>中央庭院和游泳池远离自然环境，住宅的核心是鼓励玩耍和娱乐。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371546927-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371524503-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>风车式的设计让公共区域贯穿整个生活空间，以及厨房和餐厅。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371679751-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371671725-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371698931-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371754956-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>在自然色调下将个人风格注入，并以坚实的基础和质感的材料美学为支撑，与周围的景观融为一体。房屋外部采用原始材料，包括染黑的木材，这是对房子的当地环境的微妙参考。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371746534-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p></p><p><section><p>住宅的布局也允许提供更多的私密空间。主卧室、儿童卧室和客卧均配有套间，被设计成私人区域。这种方法使个人空间与公共区域形成互补和鲜明对比，在家庭住宅中营造一种必不可少的动态平衡。</p></section></p><p></p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230203/167543371723090-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p>'),(335807,'<p>分享一个来自法国的安静小宅，80后的夫妻和孩子们在这里生活，设计师也尽量保证业主一家人的生活基础，</p><p><br/></p><p><br/></p><p>并且把业主喜欢的各种元素全部搬进家中，营造出了一个足够放松和简单的空间环境，感受到的是一种更加美好的轻松氛围，大家也来看看。</p><p><br/></p><p><br/></p><blockquote><p>房屋户型：别墅</p><p>房屋面积：200平方米</p><p>装修预算：50万</p><p>设计师：李文<br style=\"display: block; max-width: 100%;\"/></p><p>主要建材：大理石材、烤漆玻璃、天然木皮、进口耐磨地板、特殊磁漆</p></blockquote><p><br/></p><p><br/></p><p>【客厅】</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548180937520-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>设计重点：享受空间的复古主义</p><p><br/></p><p><br/></p><p>整个空间的搭配并没有关注于过多的硬装，而是更注重空间整体的细节，选择了很多丰富的色调来进行调节，展现出了空间整体的安静氛围。</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548180981279-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>中央位置预留出的休息空间选择了L型的沙发，并且搭配丰富的实木材质，散发出一个更加平静和自由的空间气息。</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548180916407-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>室外绿草如茵，更像是一个自然的装饰单品，带给空间一个更加情绪化的改变。</p><p><br/></p><p><br/></p><p>客厅的空间非常的温暖时尚，将自然机理彰显得淋漓尽致，营造出了一个现代和简约风格十足的艺术空间。</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181062773-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>单品上的选择也更加得高级，定制的组合元素，让空间整体的气质得到了改变，拥有一种更加全新的活力和魅力。</p><p><br/></p><p><br/></p><p>【厨房】</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181068672-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>设计重点：感受自然的色彩</p><p><br/></p><p><br/></p><p>厨房的空间搭配得非常和谐，尤其是色彩上的选择也比较的平衡。冷暖色调让空间变得更加温暖和简约。</p><p><br/></p><p><br/></p><p>家具上的选择也非常的具有代表性，优雅，而且又复古，整体的效果给人带来十分放松和高级的体验。</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181027981-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>厨房的空间搭配选择了比较大胆的元素进行碰撞，彰显出浓郁饱满的时尚气息和品质，也充分彰显了业主超强的改造能力。</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181070681-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>在细节之中，选择了非常考究的单品，尤其是灯光上的搭配也非常地具有特点，可以充分实现空间美学的结合。</p><p><br/></p><p><br/></p><p>【卫生间】</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181018933-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181049985-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>设计重点：巧妙实现居住的自然感</p><p><br/></p><p><br/></p><p>卫生间整体的搭配相互交融，温暖的色调搭配纯天然的自然元素，空间变得精致，而且浪漫。</p><p><br/></p><p><br/></p><p>【卧室】</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181124155-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>设计重点：营造放松的愉悦感</p><p><br/></p><p><br/></p><p>睡眠空间的空间搭配更加提供了层次上的变化，更符合了业主全新的生活方式，提供了一个更加多元化的层次改变。</p><p><br/></p><p><br/></p><p>为了满足业主的需要，选择了丰富的纹路单品进行搭配，提供出了一个安静从容的空间，整体也实现了一种自然的亲密效果。</p><p><br/></p><p><br/></p><p>同样业主收藏的艺术品，在这里散发出多样的精彩，为空间带来了更多的艺术感受。</p><p><br/></p><p><br/></p><p>【餐厅】</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181176928-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>设计重点：享受空间的全新风格</p><p><br/></p><p><br/></p><p>餐厅的空间打理得井井有条，设计师选择了更真实和简约的元素，还原出空间整体的浪漫气质。</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181157312-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>风格上的选择也比较的艺术，选择了大量的现代化单品进行搭配，让空间拥有了一种更加温暖的气质和改变。</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181182875-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>业主收藏的各种老物件在这里重新散发出全新的魅力，彰显出自己的个性，给居住者带来的也是一种前所未有的改善。</p><p><br/></p><p><br/></p><p>【露台】</p><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181148939-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548181161882-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>设计重点：享受一种亲密接触自然的魅力</p><p><br/></p><p><br/></p><p>户外露台和风景巧妙地结合，白云和鲜花交相辉映，让空间增加了一种更加甜蜜的互动和浪漫，也把这里打造出了浓浓的自然活力。</p><p><br/></p><p><br/></p><p>总结：空间整体的设计更是为了业主的生活而出发，精心的布置来满足业主的需要，喜爱的物品搭配在空间之中，打造出了一种真正让人喜欢和放松的空间效果。这也是生活之中的惊喜。</p><p><br/></p>'),(335808,'<p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">男主想要复古的装修风格，女主喜欢原木和绿色调，想要拥有开敞明亮的公共空间，让绿植可以恣意生长，猫咪们也能尽情跑酷。希望能打造复古中带着时尚，渲染温馨热闹的生活气息，浪漫且精致的居室氛围。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">房屋信息</strong><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">面积：73㎡<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">户型：二居<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">风格：北欧<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">造价：37W<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">设计：JORYA玖雅<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">户型结构</strong><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548261917000-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">原户型存在的问题：开门见厅，一览无余，私密性差，而且玄关和餐厅两个区域混在一起，缺乏明确的功能分区。原封闭式厨房狭长，操作空间拥挤。<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">平面布局</strong><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262021214-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">改造1：玄关设计一道玻璃隔断，打造入户端景，阻隔门外视线，同时将玄关和餐厅区分开。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">改造2：拆除厨房原来的墙体，新建半墙+吧台的方式，将厨房改造成U形布局，开放式布局，与客餐厅融为一体，增强家人之间的互动。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">改造3：借用部分次卧空间扩充主卧，提升主卧收纳机能。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">玄关</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262095212-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">客厅</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262040477-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262021829-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262131395-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262119100-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262169770-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262163639-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">餐厅</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262248057-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262259754-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262287417-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">厨房</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262211983-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262229719-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262238799-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">过道</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262247852-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">主卧</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262317622-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262371261-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262375719-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">次卧&amp;多功能室</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262413077-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">卫生间</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262472066-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230204/167548262471532-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; font-family: arial; background-color: rgb(255, 255, 255); margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><br/></p>'),(335809,'<p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552728745-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>北欧室内设计（Nodic design）是一种融合了布艺纹理、柔和色调的极简主义风格，用时尚、现代的装饰给人感觉温暖而诱人。它强调干净的线条、实用和简单的家具，注重实用、美观和舒适。<br/></p><p><br/></p><p>北欧设计能够在装饰上保持克制的同时，仍然让空间感觉舒适。</p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552736439-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>这种设计之所以流行，是因为它反映了我们对干净整洁的追求，以及对于居住在一个温暖、舒适环境中的期待。<br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552786957-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>斯堪的纳维亚设计（Scandinavian）并不完全等同于北欧设计（Nordic），因为同处北欧的丹麦设计自成一派，<br/></p><p>为方便描述，下文简称北欧设计。</p><h3>与自然光嬉戏</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552851730-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>明亮的北欧设计客厅，via：Fantastic Frank<br/></p><p>北欧的室内设计以其极简主义的调色板、舒适的氛围和引人注目的现代家具而闻名。<br/></p><p>具体设计上要经常利用自然光，阳光在寒冷的北欧国家是一种奢侈品。</p><h3>增加对比度</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552852775-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>黑白对比明显的北欧风格餐厅，via：LILJENCRANTZ<br/></p><p>高对比度是北欧设计的标志。在这个全白色的餐厅里，朴素的黑色餐桌有助于创造一种戏剧性的、更有冲击力的视觉效果。<br/></p><p>现代家具也与北欧历史建筑中，常见的华丽建筑细节形成对比。</p><h3>选择现代风格家具</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552832186-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>有现代家具的餐厅，via：PELLA HEDEBY<br/></p><p>即使是在刚建成的当代建筑里，现代家具也是关键。<br/></p><p>郁金香茶几和浮云沙发的组合，以木质色调和轻盈的白色调相搭配。装饰用的植物也有助于让空间感觉更有自然气息。<br/></p><p><br/></p><h3>选择柔和的颜色</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552891292-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>北欧风格的卧室，via：Tali Roth<br/></p><p>来自纽约的室内设计师塔莉·罗斯（Tali Roth）对北欧风格有自己的理解。<br/></p><p>上图的小客厅里，色彩过渡是这样自然，中性色调以灰褐色的、象牙色和浅米色等柔和色调为主。实木元素、小绿植和造型简洁的装饰都是极简主义的元素。</p><h3>多姿多彩的艺术</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552820038-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>北欧风格的餐厅，via：FANTASTIC FRANK<br/></p><p>艺术装饰画很少在北欧风格中单独使用，而它们往往成双出现，就像上图客厅里的系列植物版画一样。<br/></p><p>在餐厅里，家具通常很简单：中古风格的椅子和悬浮餐边柜。蜡烛是Hygge风格的标志，简单的黄铜烛台是Hygge最常见的表达形式。<br/></p><blockquote><p>Hygge是丹麦文化的一个特征，如今已经融入北欧设计。它旨在你的家中营造出温暖、舒适的氛围。</p></blockquote><h3>舒适的联想</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552845689-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>北欧风格的卧室，via：FANTASTIC FRANK<br/></p><p>上一节说到hygge，丹麦人试图将这一理念融入他们装饰的方方面面：让它尽可能地舒适再舒适。<br/></p><p>在这个狭小的空间里，未整理的床靠在窗户上，占据了整个空间。窗帘将睡眠空间隔开，进一步增加了私密性。</p><h3>混合布艺材质</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552818288-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>布艺元素众多的客厅，via：PELLA HEDEBY</p><p>这间客厅的特点是简单、内衬干净的家具和柔和的灰色调，但很容易感觉到寒冷，不那么吸引人。</p><p>除了引人注目的黑白照片外，多种舒适的布艺组合在一起，如靠枕、羊皮和土耳其地毯，却让人感觉很受欢迎。</p><h3>壁炉靠边</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552998087-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>壁炉在角落的客厅，via：LILJENCRANTZ<br/></p><p>对于家有别墅的朋友，我告诉你们一个秘密，北欧家庭的壁炉都在房间角落，而不是墙的中央。<br/></p><p>由此引申到别墅设计中，北欧风格的客厅家具摆放有些细节。大沙发通常要在客厅中央，较小的休闲椅则在靠近墙边的地方，注意不要靠墙。</p><h3>使用温暖的木材</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552993610-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>实木元素突出的北欧风格卧室，via：FANTASTIC FRANK</p><p>暖木色调和深褐色在北欧室内设计中很受欢迎，因为它们能使房间感觉阳光明媚，而不会像明亮颜色那样，过于喧闹，压倒空间。</p><p>浅白色、和木质色调很好地配合在一起，创造了一个友好、柔和的卧室空间。</p><h3>床品的层次</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560552932041-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>层次感强烈的床上用品，via：PELLA HEDEBY</p><p>瑞典人和丹麦人擅长以最友好的方式将床上用品分出层次。</p><p>包括亚麻布床单、羊毛毯和靠枕在内，它们的颜色通常都很柔和。标志性的灯具在北欧风格的卧室里也很常见，北欧人经常使用天花板上的灯具和床头灯，来诠释这种现代的风格。</p><h3>小面积的突出色彩</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560553046381-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>色彩明快的客厅一角，via：FANTASTIC FRANK<br/></p><p><br/></p><p>在北欧风格中，鲜艳的色彩通常是小的凸起或明亮的色调，几乎像是画廊。<br/></p><p><br/></p><p>在上图这个明亮的客厅里，中性的底色被彩色赋予了生命，地毯的蓝色和紫色的装饰，与墙边的各种艺术品提供了强烈的色彩爆发。</p><p><br/></p><h3>混合装饰风格</h3><p><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560553068568-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p><p>融合北欧与现代风格的餐厅，via：FANTASTIC FRANK</p><p><br/></p><p><br/></p><p>虽然北欧室内装修更偏向现代，但它们往往以混合不同时期的风格为特色。</p><p><br/></p><p><br/></p><p>在这个安静的餐厅里，镀金画框里的油画挂在一系列玻璃罐的上方。在光滑的黑色餐桌上方，挂着一个超大的工业感的吊灯。</p><p><br/></p>'),(335810,'<p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">本案常住者为幸福的一家三口，屋主两人都希望新居能简单点，同时还要有温馨氛围。经沟通之后，将这140㎡的三居室，定案为现代简约风，唯美浪漫的空间配色、简洁明朗的造型设计，承载岁月的温柔。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560580953861-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">客厅</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">温柔的奶茶色铺满每个角落，在偏暖的灯光映衬下，给人以温馨治愈的视觉感受。背景墙利用石膏线做了简单的造型修饰，保留现代风的简洁美，也丰富着空间层次，张弛有度。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560580929420-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">与沙发墙一致，电视背景墙利用石膏线勾勒的对称式几何造型，赋予客厅以艺术氛围，呈现出静谧柔和的格调。造型简洁的家具之下，铺设一张白色的短绒地毯提升居住舒适度，也为居室添一份温馨气息。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560580985591-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">餐厅</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">利用通铺的地砖加强不同功能区之间的交互，从而保证空间整体感。背景墙延续了客厅的基调，奶茶色墙面，辅之以同色石膏线进行修饰，中间是一幅别致的挂画点缀，与餐桌上的绿植相辅相成。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560581063400-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">利用局部墙面空间定制了顶天立地式的餐边柜，增加玻璃柜门作为酒柜使用，满足不同的收纳需求。由于厨房空间受限，冰箱外移至餐边柜区域，提前预留出适合的位置，形成无缝衔接。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560581043603-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">卧室</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">淡淡的奶茶色作为主调，通过简化空间造型，于视觉上营造出简洁明朗之感，着重于使用功能的体现。在睡眠区之外，利用转角区域做了开放式衣帽间，并于床头增设梳妆台，金属与木质的简单组合，精致实用。飘窗应屋主要求，做了保留，表面铺上一层软垫，便是绝佳的休闲观景区，为平淡的生活增添些趣味和闲适。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230205/167560581058109-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">温柔的奶茶色赋予空间以特有的治愈氛围，在线条的勾勒下，平添一份艺术气息。整个居室在现代风的简洁中，彰显出居者对生活品质的高要求，温暖舒适。</p><p><br/></p>'),(335811,'<p><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230206/167564902269950-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p>凭借优质的海景、养生资源，过去十余年间，山东省威海市乳山银滩旅游度假区（以下简称“银滩”）曾迅猛发展，记者在多平台看到“约有200个海景房小区分布在长21公里、宽3公里的银滩上”的统计，无数“老年看房团”蜂拥而至。<br/></p><p>如今，随着海景房开发浪潮的退去，乳山的房地产市场也不断衰落，新盘开发停滞不前，只留下大量“白菜价”的二手房和“鬼城”的称号。近日，“不到十万可买海景房”“有的公寓一平米只有几百元”的报道，再次将乳山推至舆论中心。</p><p>“海边鹤岗”房价跌破千元？</p><p>乳山的房价真有这么低吗？在诸葛找房平台上，记者看到，只有一套单价为513元的房源，但房屋用途为“写字楼”。不过，在诸葛找房、安居客等购房平台上，总价低于十万元、均价约2000元—2500元的“捡漏”“急售”二手房房源比比皆是。如果对面积要求不高，仅需5-7万元，即可购买一套30平方米的精装修一室户。</p><p>例如，万豪庭海苑一套41.8平方米的房源，均价为2033元/平方米，总价仅需8.5万元。从小区成交记录来看，2021年3月成交的一套房源，均价为4835元/平方米，如今的挂牌价相当于“腰斩”；同为“一线海景房”，海林花园一套49平方米的精装修房源总价10万元，挂牌9个月后降价2万元。</p><p>“楼梯房、高楼层，没有物业服务，或是装修一般、冬天没有暖气的话，几万块确实能买到（房子）。”当地中介老齐（化名）向《华夏时报》记者坦言：“实际成交价格还能更低。房子太多了，现在很多在低价抛售，你可以好好挑一挑。”</p><p>房价极低的同时，乳山的房租也堪比“白菜价”，一套海景房的月租金仅为300-500元，长租的价格则更为低廉。以海洋明珠小区一套500元月租的房源为例，房东称整年租可降至4000元/年。</p><p>记者注意到，上述“白菜价”房源几乎均位于乳山银滩。58安居客研究院院长张波告诉记者，因为“房地产过度开发、却没有吸引到实际的人口所导致的房屋空置”，成为银滩二手房价极低的根源。</p><p>据乳山市人民政府官网资料，银滩因辖区内长达21.7公里的洁白沙滩而得名，区域气候条件宜人，空气质量等级常年“优”，负氧离子丰富。</p><p>凭借优质的自然资源，银滩受到了开发商的青睐。2010年3月，乳山市政府关于加快银滩旅游度假区发展的一份文件中指出“近年来银滩房地产业迅猛发展”。公开报道显示，2007年—2010年是乳山银滩开发的鼎盛时期，三年间房屋竣工的总面积达562万平方米。截至目前，“约有200个海景房小区分布在长21公里、宽3公里的银滩上”是公认的说法。</p><p>随着大开发的推进，“海景”“疗养”“养老”等广告词也吸引了广大老年客群。</p><p>“大巴车直接从上海拉到乳山。”上海人黄珏（化名）告诉《华夏时报》记者，2013年，退休的黄珏父亲在小区门口拿到一份房屋销售传单，被“负氧离子”“长寿之乡”的描述深深吸引。4天的“免费旅游”结束后，黄珏父母名下多了一套乳山银滩的房子。</p><p>老齐对于当年的热闹也是记忆犹新：“大巴车一辆接一辆，都是老年人。”值得一提的是，这也是乳山楼市存在“反倒挂”现象的原因：在二手房低至2千元/平的乳山，在售新盘价格却普遍在7千至8千元。几万元就能买一套二手海景房的银滩，在售新盘金鼎玺悦项目的单价甚至接近万元。老齐解释说：“（人）当时都是直接拖到售楼处的，有人一买好几套，后面想出手亏本就卖不掉。没人要，二手房不就便宜了？”</p><p>那些年，房子卖出去不少，但因为交通、医疗等硬件配套的缺乏以及寒冷的气候，留在银滩的外地人并不多。</p><p>渴望“滨海度假生活”的黄珏父母，买房后住在银滩的日子屈指可数。“太远了，没有直达的飞机或是火车，都得从威海转。”黄珏解释说，以火车通行为例，从上海虹桥站出发，需要先耗时近7个小时到盐城，再从盐城换乘约2小时到威海。之后还需坐大巴到乳山，“差不多要折腾一天了”。</p><p>与此同时，潮湿与寒冷也是难以回避的问题。因为气温较低，除了夏天可以来避暑，其他三季银滩不少海景房都处于空置状态，而“一线海景房”斑驳与发霉的墙壁也让老人觉得这里“比上海还潮”。最重要的是，随着年岁渐长，黄珏的父母愈发重视医疗配套。但相比医疗资源在全国数一数二的上海，乳山显然不是一个好的选择。</p><p>2022年的夏天，有游客晒出银滩的夜景，白天鳞次栉比的海景房，晚上亮起的灯光却只是星星点点，这也让银滩多了一个“鬼城”的称号。“没人来的地方，房价能不跌吗？”老齐显得有些无奈。</p><p>监管层多措并举盘活市场</p><p>事实上，随着海景房开发浪潮的退去，乳山的房地产市场早在数年前便衰落。据乳山市统计局发布的国民经济和社会发展情况公报，2010年，该市房地产开发投资64.43亿元，比上年增长27.79%。但从2014年开始，乳山的房地产开发投资便开始大幅度下滑，2014年全市房地产开发投资完成36.32亿元，同比下降52.46%。到2018年，乳山的房地产开发投资仅为23.38亿元。</p><p>2019、2020两年，乳山市没有公开该市房地产开发投资的具体数据，只透露2019年的房地产开发投资同比增长7.03%。之后，2021年，全市房地产开发投资41.62亿元，同比下降31.4%；2022年前三季度，房地产开发投资20.93亿元，同比下降32.3%。</p><p>面对房地产市场的持续下行，乳山市政府近年采取了多项措施，完善城市基础配套的同时，也加紧盘活银滩存量二手房、尽力“稳楼市”。</p><p>例如，乳山在滨海新区规划设置了10条公交线路，其中4条线路到达市区，6条线路在银滩区域内运行；日投放45辆车运行，占全市日投放车辆总数25%；为满足银滩居民日常医疗需求，还新建了二级乙等综合性医院，引进华慈医院等。</p><p>在房地产开发方面，2015年，乳山开始将银滩旅游度假区的定位调整为“新城区”，建设宜居新城谋求转型。例如，乳山银滩取消了普通海景房的规划审批，要求沿海所有项目在规划上必须配套配餐中心、医疗护理、文化娱乐等服务，打造“养老养生天堂”。</p><p>另一方面，乳山市也加强了对银滩楼市的监管力度。其中，2020年末，乳山召开房地产健康发展座谈会，强调将完善房地产市场监管机制，运用大数据对房产销售产业链进行全过程监管，探索购房冷静期机制，从制度上规避退房退款难问题。2021年末，为规范海景房销售市场，乳山市又结合银滩住房市场特点推行了包括“看房团”备案、信息主动公开、权利义务告知的“六步购房法”。</p><p>在2022年工作计划中，乳山市住房和城乡建设局强调“多措并举，加强房地产市场监管”，提出加强海景房销售过程监管，对存在落实政策不力、销售过程不规范等问题的开发企业进行约谈、责令整改；以及全面推行“三码公示”“五真房源”，提高房屋交易信息透明度等。</p><p>“人走了”和“人不来”</p><p>尽管如此，业内人士仍直言，结合楼市行情和人口、产业的现状来看，当地市场需求依然有限，短期内市场热度仍难恢复。</p><p>“鹤岗是由于资源性产业萎缩，导致大量人口流失产生房屋空置；乳山是房地产过度开发、却并没有吸引到实际的人口所导致的房屋空置。”张波认为：“换言之，鹤岗是住的人离开了，而乳山是根本没有吸引到人来住。”根据乳山年鉴，2021年，该市办理户口迁入873人、户口迁出3567人。</p><p>整体来看，2021年，乳山市总人口为536051人，比上年（2020年）减少5976人；2021年全年出生人口2416人，出生率4.48‰；死亡人口5740人，死亡率10.65‰，人口自然增长率-6.17‰。另一方面，该市老龄化程度持续加深：截至2021年12月底，60岁以上老年人185472人，占乳山市总人口34.6%，比上年增长1.3%。</p><p>张波建议，目前乳山应该更多发展产业配套、拉动更多人口流入，而非单一通过旅游资源来吸引人群。“产城融合、宜居宜业，同时兼顾旅游资源，或许更有利于闲置房产的去化以及城市未来长期发展。”张波说。</p><p><br/></p>'),(335812,'<p>极简主义！少即是多真正含义是什么？</p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962434997-17-0.jpg\" index=\"0\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962472006-17-0.jpg\" index=\"1\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962466013-17-0.jpg\" index=\"2\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962472685-17-0.jpg\" index=\"3\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962410161-17-0.jpg\" index=\"4\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962482257-17-0.jpg\" index=\"5\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962487008-17-0.jpg\" index=\"6\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167564962479470-17-0.jpg\" index=\"7\" style=\"border: 0px; max-width: 600px; border-radius: 12px; height: auto; width: 600px;\"/></p><ul class=\"index-module_uiCarouselIndicators_2qeGn list-paddingleft-2\" style=\"list-style-type: none;\"><li><p><br/></p></li></ul>'),(335813,'<p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304395980-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">多数人对复古的印象就是布满雕花的欧式风格。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">其实复古元素与现代设计风格、北欧风格，甚至是极简风格的搭配都堪称完美。</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">接下来，我用15个案例为您讲解，复古元素是如何与现代家居完美融合的：</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">复古的黑色</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304338899-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Anders Bergstedt</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">这张漂亮的黑色复古办公桌配备了一盏现代设计的台灯。</span><strong style=\"max-width: 100%;\">精致与办公桌的复古形成了很好的对比。</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304371189-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Anders Bergstedt</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">沉稳的黑色，给空间增加了分量，安抚着每一颗浮躁的心。而陶罐与枯枝的装饰，将外观提升到另一个层次，合力打造出一片现代禅境。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">当极简遇上复古</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304411873-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Frederik J Karlsson</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">极简主义并不完全等于缺乏装饰</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">，上图这张复古小书桌让极简的白色卧室变得难以置信的优雅和迷人。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304473553-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Frederik J Karlsson</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">极简主义也不完全等于缺乏颜色</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">，实木色调的书桌，深灰色的布艺座椅，把原本全白色的卧室点亮，坐在上面工作都不会觉得累。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">全复古外观</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304482895-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Stadshem</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">前面的例子都是复古与现代的结合，而这间小书桌则是完全的复古外观。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">复古书桌、复古椅子、复古台灯，将复古进行到底。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">与灰色搭配</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304416779-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Henrik Linden</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">除了复古书桌和挂在上面的木质相框，为空间提供暖色调外，这间卧室完全是灰色的。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304582534-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Henrik Linden</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">黑色的水滴椅</span><span style=\"max-width: 100%;\"><span style=\"max-width: 100%; color: rgb(153, 153, 153); --tt-darkmode-color: #999999;\">（Drop Chair）</span></span><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">由北欧工业设计大师阿纳·雅各布森</span><span style=\"max-width: 100%;\"><span style=\"max-width: 100%; color: rgb(153, 153, 153); --tt-darkmode-color: #999999;\">（Arne Jacobsen）</span></span><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">在1958年为哥本哈根丽笙酒店设计。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">增加温馨感</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304585879-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Fredrik J Karlsson</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">实木的复古书桌在米色的墙壁映衬下，</span><strong style=\"max-width: 100%;\">给房间带来无以复加的温馨氛围。</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">白色的蚂蚁椅</span><span style=\"max-width: 100%;\"><span style=\"max-width: 100%; color: rgb(153, 153, 153); --tt-darkmode-color: #999999;\">（Ant Chair）</span></span><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">则呼应了窗帘、床品等布艺的白色色调。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304561109-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Fredrik J Karlsson</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">大面积的米色，</span><strong style=\"max-width: 100%;\">实木色很好的弥补了白色的现代外观所带来冰冷感。</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><blockquote class=\"bjh-blockquote\" style=\"margin: 0px; padding: 0px 0px 0px 30px; overflow-y: auto; max-width: 100%; position: relative; min-height: 24px; color: rgb(153, 153, 153);\"><p style=\"max-width: 100%; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">蚂蚁椅（Ant Chiar），由阿纳·雅各布森（Arne Jacobsen）为一家丹麦的食堂所设计，1952年被Fritz Hansen大规模生产。</p></blockquote><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">精致的细节</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304581721-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Alvhem</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">复古不代表质朴和破旧，它也能拥有精致的细节，</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">给室内设计的现代风格锦上添花。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304580446-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Alvhem</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">正如上图的办公桌一样，复古风格之下拥有如艺术品般完美的细节设计。墙上的蓝色印花装饰，桌上的一株小绿植，是对室内环境的有趣补充。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">与鼠尾草绿色搭配</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304543206-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Linnéa H. Manaberi</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">鼠尾草绿色与实木色调是绝配，搭配的诀窍是要让绿色的深度，与实木色调的深度保持一致。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304616760-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Linnéa H. Manaberi</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">白色的Gatto台灯，与白色的金属椅子相结合，平衡了复古样式书桌所带来的沉重感，维持了房间整体的现代风格装修。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">更多鼠尾草绿色调灵感，请看这里：选这种橱柜颜色，绝对惊艳整个家</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><blockquote class=\"bjh-blockquote\" style=\"margin: 0px; padding: 0px 0px 0px 30px; overflow-y: auto; max-width: 100%; position: relative; min-height: 24px; color: rgb(153, 153, 153);\"><p style=\"max-width: 100%; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">Gatto台灯有着“虫茧”的外观，由设计师Achille Castiglioni在1950年设计于意大利。</p></blockquote><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">时间的沉淀</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304681831-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">photographed by Anders Bergstedt</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">上图中的斑驳的旧桌子与颇具现代感的利落的线条相结合，创造出“新”与“旧”的碰撞。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304688610-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: cent