x ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304657024-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Alvhem</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">除了米色的窗帘，</span><strong style=\"max-width: 100%;\">粉色也会回归到床上用品上，</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">淡淡的粉色调很有凝聚力，有着女性的精致与优雅。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">与绿植搭配</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304643279-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Entrance Makleri</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">我认为复古家具和室内植物总是能很好地结合起来。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">实木的黄色与绿植，将大自然元素带入室内，给人安静平和的感觉，学习效率事半功倍。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">解决布局</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304727343-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Stadshem</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">当你的户型特别奇怪，空间特别狭小，该怎样挑选家具？</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">可能很多人都会选择定制家具。定制家具是可以解决一些难以利用的小角落，</span><strong style=\"max-width: 100%;\">但是他们的使用寿命往往不佳。</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">本质上说，</span><strong style=\"max-width: 100%;\">定制家具是为了在大户型中获得更具整体感的外观，而不是为了在小空间里缝缝补补。</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304797790-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Stadshem</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">其实想利用不规则的小空间，你可以试试复古感的实木家具，就上这间卧室里的书桌一样。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">作为白色、灰色的过渡</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304740996-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Kvarteret Makleri</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">白色和灰色的组合历来因为过渡不明显，缺乏视觉重量，</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">而被人所诟病。是时候考虑加一张黑色的复古书桌了。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304747756-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Kvarteret Makleri</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">当沉稳的黑色成为视觉焦点，白色和灰色都成为它的背景。</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">黄铜的抽屉把手、曲木藤编椅，为这种原本朴素的现代风格增添了有趣的元素</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">视觉焦点</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304792331-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Stadshem</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">尽管这个案例和上一个类似，都是浅色空间里的黑色书桌。但这间小书房解释了，什么是视觉中心。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-bottom: 28px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">与大空间相同，小空间也同样需要视觉重心</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">，你几乎只注意到了黑色的书桌，忽略了空间的狭小。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">出乎意料的颜色</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304821397-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Entrance Makleri</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">这间卧室里的主角不再是复古书桌，而是这把蓝色的曲木椅。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">蓝色很少用在桌椅上，但就是这出乎意料的颜色成为整个北欧风格卧室的点睛之笔。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304840510-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Entrance Makleri</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">北欧气候寒冷、日照时间短，因此北欧人对阳光、大自然充满向往，反映在室内设计上，真实的北欧风格是善用色彩的、明亮的。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">北欧家居设计的奠基者，瑞典人卡尔·拉森</span><span style=\"max-width: 100%;\"><span style=\"max-width: 100%; color: rgb(153, 153, 153); --tt-darkmode-color: #999999;\">（Carl Larsson ）</span></span><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">本身也是一名水彩画家。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304846859-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">卡尔·拉森的鲜艳的水彩画</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">令人兴奋的色彩</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304832446-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Entrance Makleri</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">如果你不理解色彩对空间情绪的调动，那就看看这张粉色书桌，当它与深蓝色墙面搭配在一起，</span><strong style=\"max-width: 100%;\">活泼的氛围感顿时跃然眼前</strong><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304826171-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><span class=\"bjh-image-caption\" style=\"display: block; margin-top: 11px; text-align: center; font-size: 13px; color: rgb(153, 153, 153);\">via Entrance Makleri</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">现代风格的室内元素，如白色台灯，天花板上白色的纸质吊灯，以及白色蚂蚁椅</span><span style=\"max-width: 100%;\"><span style=\"max-width: 100%; color: rgb(153, 153, 153); --tt-darkmode-color: #999999;\">（Ant Chair）</span></span><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">与复古书桌和墙壁的蓝色形成了对比，而视觉则回归于桌子上方的印刷版画之上。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230206/167567304847033-17-0.png\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><h3 class=\"pgc-h-center-line\" style=\"margin: 0px; padding: 0px; font-size: 18px; overflow-y: auto; max-width: 100%;\">最后</h3><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">一张复古书桌能与现代设计、北欧设计很好的结合在一起。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"margin-right: 8px; margin-left: 8px; overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; color: rgb(80, 80, 80); --tt-darkmode-color: #969696;\">在软装设计中，复古元素的加入总是能让人眼前一亮，让你体会到风格混搭的精妙。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><br/></p>'),(335814,'<p>楼盘名称：伴山名郡</p><p>户型面积：170㎡<br/></p><p>装修风格：现代简约风<br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967278435-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>暖色木材的映衬，让空间柔和宁静<br/></p><p>点、线、面的穿插，让空间层次有度<br/></p><p>软装的留白，让空间的使用自由度大幅提升<br/></p><p>质感的呈现，亦是情绪的表达<br/></p><p><br/></p><h3>客厅</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967279453-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>功能至上，是本案空间设计的核心<br/></p><p>使用者的习惯通过设计得到延伸变化<br/></p><p>同时以大理石、金属、原木等不同材质填充<br/></p><p>赋予空间动态多元，质感与氛围十足<br/></p><p>临窗而设的观景地台、桌几<br/></p><p>构成闲适的居家意趣<br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967256539-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>公区结构造型亲密叠加、有序配合<br/></p><p>干练块面、饱满层次融合为一整体，温馨且自然<br/></p><p>利落的柜体，疏密有致的线性纹理<br/></p><p>创造出惊艳的空间表现形式<br/></p><p><br/></p><p>卧室</p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967266358-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>主卧整体色调气质沉稳<br/></p><p>木质元素承接平面与立面<br/></p><p>黑色与白色、木色将层次逐级拉伸开<br/></p><p>整个空间呈现出简而不凡的效果<br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967276593-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>次卧榻榻米地台设计<br/></p><p>实现空间极致利用<br/></p><p>赋予其舒适自由、灵动现代的格调<br/></p><p>温暖意趣的空间里，探索生活温度<br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967340739-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>儿童房是一方可爱的小天地</p><p>兼具学习与储物功能</p><p>定制的上下床可以容纳两个孩子<br/></p><p>满是趣味，成长的仪式感满满<br/></p><p><br/></p><p>卫生间</p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967345281-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>主卫延续了主卧的色彩格调<br/></p><p>以大面积的石材，铺就干净利落的功能区域<br/></p><p>线条整齐划一，墙面简洁大方<br/></p><p>深色的空间内，高级时尚的质感满分<br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967347371-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967381198-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>客卫以纯白色为基调，纯粹朴质</p><p>男士小便器与坐便器双重搭配</p><p>解决了多数家庭面临的烦恼</p><p><br/></p><p>干净卫生，谢绝尴尬</p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967365570-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p><br/></p><h3>阁楼</h3><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967342861-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>阁楼上的小卧室简单、明净</p><p>没有大量材质的堆积，没有过多色彩的缭乱</p><p>全屋以白色为主，温润内敛的静谧感</p><p><br/></p><p>谱写美好而缓慢的日常</p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967327033-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p>独立游戏区为孩子的童年</p><p>造就了一个专属乐园</p><p>楼顶天窗让阳光肆意洒入</p><p>孕育成长时光的更多奇思妙想</p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167572967317380-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p>楼梯的造型简约充满设计感</p><p>与空间恰到好处的留白形成对比</p><p>整体更加通透视觉感更佳</p><p>极简气质瞬间提升</p>'),(335815,'<p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">生活总是在日出时最美丽，而家是自己和家人居住的地方，舒适和自在最重要。当你拥有一个温暖有趣的家，在自己喜欢的房子里醒来，你也会不再惧怕炎热骄阳，以及寒冬肆虐。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156628206-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲女主人和狗狗</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">从事摄影记者工作的女主人伊洛娜生活在芬兰</strong><span style=\"max-width: 100%;\">。她的生活座右铭是一定人要有梦想，敢于挑战和冒险。她做过很多工作，比如收银员，也做过清洁工、推销员、汽车司机，也坚持写书，如今是一名记者和摄影师。她的家，究竟会是什么样子呢？</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156787802-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156733315-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156719185-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲房子外观</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">和我们印象中现代简约的北欧家庭不同。她的家，乡村和复古的气息非常浓厚，看不到现代感的家具和装饰品，每一件家具都是那么的老旧，充满了个性，而且又是那么的迷人。而且她又是那么的喜欢大自然，把身边大自然的赐予，装饰温暖的家。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; background: yellow;\">生活空间：没有什么比旧物件更有韵味的了</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156742917-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156773565-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲客厅</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">一个人的家，肯定需要一些特别的魅力和闪光点。“如果我能爱上一道风景，那一定是秋风所住的地方。”在女主人看来，树叶木头这些大自然本身带来的温暖色彩，可以让家闪闪发光。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156844653-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲客厅细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">除了喜欢棕色调，用地毯来改变客厅的氛围，特别是把许多小地毯组合起来，而不是用一张大地毯，也是女主独特的扮家灵感。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156862609-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156822115-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲客厅细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">沙发旁边的这片壁纸打造的墙是女主的得意之作。在壁纸墙上加入鸟、花、藤蔓和手工艺品，好像是一个特别文艺又充满艺术感的照相馆背景。这也特别符合主人当下的职业，室内摄影师身份。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156879295-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156891384-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲局部</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">“老家具拥有着我们从来没有听说过的故事，而我们能做的就是处于欣赏之情刮擦发光的表面。”这是女主人对旧家具的理解。窗边有主人手工制作的灯罩，跳蚤市场上买来的餐柜上有自己做的花环装饰，在生活的过程中，不断尝试按时节和心情做些小改变，也是让家变得鲜活的方式。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156827468-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156825529-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲餐厨空间</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">女主人喜欢这个家的早晨。在其他家人依然熟睡时，点燃蜡烛，先泡一杯咖啡，开始准备早餐是一天美好的开始。在这里，宜家的橱柜搭配老旧的木柜，还有砖砌的旧炉灶区，新与旧的融合很有乡村风格的感觉。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156837776-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156945070-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲厨房细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">每个人都有特别钟爱的颜色。对女主人来说，适合她的是柔软的绿色。阳光、苹果园的绿、夏日的梦或秋色的美景，在这个厨房里都能拥有。水槽里绽放的郁金香，那是平凡生活里的仪式感。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156979724-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156942333-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲局部</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">客、餐、厨三个区域打通成一体，硬装简单，软装很乡村很个性，每个角落都能看到主人的生活影子。所以，家装未必就需要贵重的家具或者艺术品太提升品味，你喜欢的，你所钟情的，就是美丽的。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156923759-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156925953-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲角落</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">旧家具的木头纹理，每一条都充满了故事。在家里有这样一个角落，是给自己的心留一处精神领地。女主人也把自己的职业习惯带到家中，喜欢拍下好看的东西，记录回忆和梦想，抓住此时此刻的生活。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; background: yellow;\">休息空间：置身自然氛围中，登上幸福的山丘</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156998569-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573156914500-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲卧室细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">自然静谧的卧室空间，当然也少不了花的身影。大丽花图案的被子，好像伸手去找窗台上的光；床边的斑驳的老式长凳，功能依然在线。女主人觉得，当拥有一件老物件时，拿喜欢的花瓶放上鲜花去配它们最合适。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573157029618-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573157079038-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲卧室细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">家居生活中，最好的事情就是拥有一个新鲜的卧室，床品就是季节装饰最好的表达。当天气开始变得的暖和，换上干净的床单，就能带来更加宁静的睡眠。一扇淘来的老门板，也可以是很好的装饰品；木板凳还有草帽灯，就好像睡在自然里。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; background: yellow;\">门廊：色彩和喜欢的物件，带来欢乐和幸福</span><br style=\"display: block; max-width: 100%;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573157046760-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573157069938-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲门廊细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">这个玻璃门廊的框涂成了黑色，看起来会比较压抑。在春冬的阳光下，门廊需要轻盈和清新，所以主人用烟灰色图案装饰半墙，用绿色涂刷老柜子，根据光线变化颜色有些变化，并且通过植物鲜花以及地毯等软装来点缀，带来活力。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%; background: yellow;\">写在结尾：</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167573157110281-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲女主人的摄影作品</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">正如女主人所说的那样，有时候你不知道早上起来这一天会带来什么，但是总是会期待接下来的日子是美丽可爱的。有鲜花和植物陪伴的家居氛围，置身大自然，就觉得美好而令人感到幸福。</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">如果你也喜欢这个家，</strong><strong style=\"max-width: 100%;\">就点赞收藏</strong><strong style=\"max-width: 100%;\">分享这份美好吧。</strong></p><p><br/></p>'),(335816,'<p><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230207/167573170038810-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p>佛山楼市 梁宝欣/摄</p><p>促进住房消费成为各地稳经济的重要一环。</p><p>近段时间，多个省市在提振2023年经济的会议和文件中，把住房消费提振纳入到新一年经济发展的框架之中，住房消费在2023年经济“拉动力”方面扮演更为重要的角色。</p><p>广东省城规院住房政策研究中心首席研究员李宇嘉指出，从2022年下半年开始，国家对于房地产的基调有所调整，即从过去几年的“防风险、促转型、打造新模式”，开始转向“防风险、稳增长、促内需、打造新模式”。稳增长、促内需的权重上升了。在政策上，包括降低利率，房价下跌城市不设下限，退出或收缩行政干预政策，延长贷款集中度管理政策过渡期等，房企再融资开闸等“三支箭”发出。</p><p>值得注意的是，经《华夏时报》记者统计，2022年全国（不含港、澳、台）GDP十强城市中，除了北上广深外，其余6个城市（重庆、苏州、成都、武汉、杭州、南京）去年均在一定程度上放开对楼市的限购。除此之外，像佛山、东莞等2022年GDP过万亿元的城市，则放开全域限购。</p><p>诸葛找房数据研究中心高级分析师关荣雪认为，“预计后续还将会有更多热点二线城市跟进，预计除了一线城市外，其他城市或将全面取消限购。”</p><p>多个GDP过万亿元城市优化楼市政策</p><p>近日，随着各地陆续公布2022年经济运行数据，最新的全国（不含港、澳、台）GDP十强城市排名出炉，其十强分别是：上海、北京、深圳、重庆、广州、苏州、成都、武汉、杭州、南京。</p><p>值得注意的是，经《华夏时报》记者观察，在2022年全国（不含港、澳、台）GDP十强城市中，除了北上广深四大一线城市外，其余6个城市在2022年均在一定程度上放开了对楼市的限购。</p><p>以重庆为例。2022年12月28日，重庆多部门联合出台《关于进一步促进房地产市场平稳健康发展的通知》，明确提出激活市场有效需求，优化商贷住房套数认定，居民将存量房盘活用作保租房的，可不纳入家庭住房贷款套数计算，支持刚需，在渝生活、工作的非本地户籍的居民及成渝双城经济圈川籍居民享受同城待遇，加大货币化安置的力度、延长认购期支持家庭“先买新再卖旧”等。</p><p>对此，克而瑞分析称，该项措施进一步降低了外地入渝居民、本地购房人群的买房门槛，扩大了购房人群，对合理改善需求给予支持；并且有助于盘活存量资产，进一步助力“租购并举”的多体系供给。同时，在成渝一体化发展驱动中，通过贷款政策同城化，扩大客群基底，加深双城联动。</p><p>而GDP紧随广州的苏州，也在2022年4月放松了二手房限售、限购政策。具体来看，二手房限售时间由5年改为3年；在限购方面，非苏州户口购房由3年内连续满24个月社保改为累计24个月，同时外地人卖房后2年内，无需社保或税单可直接购房。</p><p>值得一提的是，2022年9月14日，苏州对非本地户籍居民购房政策做出调整，外地人在苏州六区（吴中区、吴江区、姑苏区、相城区、高新区、工业园区）购买首套房无需开具社保证明或个人所得税证明，但只限购1套。不过，时隔仅一日，苏州便恢复2022年9月16日之前购房政策，即需要提供三年内连续6个月社保或个税证明。</p><p>彼时，中指研究院指出，在中央坚持“房住不炒”定位的指导下，一二线城市政策优化的力度普遍偏弱，各地高频小步优化成为2022年以来房地产政策调整的一大特点。</p><p>就如成都，2022年“高频小步”松绑限购范围，扩大购房人群。2022年12月30日，成都市房地产市场平稳健康发展领导小组办公室《关于进一步明确我市房地产调控政策有关规定的通知》提出，父母投靠成年子女入户的，可以作为单独家庭在户籍对应的限购区域购买一套住房。</p><p>而在此前的11月17日，成都市房地产市场平稳健康发展领导小组办公室印发《关于进一步优化区域限购措施的通知》，优化区域限购措施。</p><p>除此之外，武汉、杭州、南京2022年均在一定程度上放开了对楼市的限购。</p><p>佛山、东莞“一次性放开”全域限购</p><p>相比于上述城市的“不断试探”，2022年GDP过万亿元的佛山和东莞则选择“一次性放开”。2022年12月9日，佛山市住房和城乡建设局印发了《佛山市住房和城乡建设局关于进一步优化房地产调控政策的通知》，明确指出：自2022年12月10日起，在本市禅城区祖庙街道、南海区桂城街道、顺德区大良街道暂停实施住房限购政策，但须自商品房买卖合同网签备案之日起满3年方可上市交易。该政策的发布，意味着佛山全域放开了限购。</p><p>不久之后，东莞也跟上佛山的步伐，全域不再实行商品住房限购政策。2022年12月26日，东莞市住房和城乡建设局发布《关于进一步优化房地产调控政策的通知 (东建房[2022] 23号)》，确认从通知发布之日起，莞城街道、东城街道、南城街道、万江街道、松山湖高新技术产业开发区全面暂停实施商品住房限购政策。这意味着东莞坚持6年之久的限购政策全面取消。</p><p>值得一提的是，2022年佛山和东莞的GDP分别为12698.39亿元和11200.32亿元，GDP排名位列广东21个地级市中的第三、第四名，仅次于深圳、广州。</p><p>关荣雪曾在2022年12月26日就向《华夏时报》记者指出，东莞全面放开限购以及放松限售是深入落实因城施策的调整之举。</p><p>2022年12月15日至16日，中央经济工作会议在北京举行。其中，中央经济工作会议提及，要因城施策，支持刚性和改善性住房需求，解决好新市民、青年人等住房问题，探索长租房市场建设。要坚持房子是用来住的、不是用来炒的定位，推动房地产业向新发展模式平稳过渡。</p><p>国家高端智库研究员宋丁在2月5日接受《华夏时报》记者采访时表示，除一线城市外，其他城市放开限购是一个大的趋势。因为限购政策是当年供不应求时代的产物。在供不应求的情况下，如果不限制，房价就会上涨得厉害，所以该政策就一直保持着。</p><p>“现在国家房地产的基本性发生了一个根本的逆转。在这个情况下，除了这两年的房企债务问题，即保交楼的问题，根本上的问题是供需关系发生逆转。也就是说现在楼市的需求，特别是那些二、三线GDP万亿元城市的需求在收缩，很多人都已经有房子了，买的人也没那么多。而且，随着整个楼市投资的增幅增长（减缓），这里面的机会也越来越少了，所以说买房的人越来越趋向平缓。这个时候还限购的意义就不大了。”宋丁说道。</p><p>东莞市统计局数据显示，2022年东莞房地产开发投资下降7.9%。同时，克而瑞数据显示，2022年东莞楼市供应322万平，同比下降45%；成交267万平，同比下降43%。在二手房方面，其成交量延续低位态势，但在政策宽松力度加码下（限购限售政策的松绑、增值税免征年限缩减），有效刺激了下半年二手市场交易持续活跃，呈现企稳态势，复苏强度优于新房。</p><p><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230207/167573170059045-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p>图源：克而瑞</p><p>关荣雪也对记者指出，“在东莞之前，西安、杭州、佛山等城市也调整了限购，说明新一轮需求端的纾困政策已经由热点新一线或二线城市率先开局，在当前房地产市场尚待加速修复的背景下，金融支持房地产政策要应出尽出、因城施策，充分发挥政策积极效应，预计后续还将会有更多热点二线城市跟进，预计除了一线城市外，其他城市或将全面取消限购。”</p><p>数据显示，西安、杭州、佛山2022年的GDP分别为1.15万亿元、1.88万亿元和1.27万亿元，三座城市的GDP均超万亿元。其中，佛山市人民政府门户网站公开的数据显示，2022年佛山房地产开发企业完成投资1956.52亿元，同比下降16.5%；其中住宅投资下降16.2%。分地区看，禅城区房地产开发投资同比下降1.0%，南海区下降26.3%，顺德区增长1.0%，三水区下降42.9%，高明区下降52.4%。</p><p>地产经济学家邓浩志在2月5日向《华夏时报》记者指出，放开楼市限购，主要是因为楼市下行引发的问题多了，比方说，房企遇到资金问题、银行遇到业务增长的问题、购房者面临资产价格下跌、地方政府面临财政减少等等，牵一发而动全身，所以重振房地产，提升经济，解决一系列问题。</p><p>成效如何？</p><p>那么，放松限购后对当地楼市有何影响？</p><p>据记者观察，从之前放松限购的城市来看，有些城市在放松限购后短期内当地楼市的成交量明显得到提振；而有些城市放松限购后，却没有带来明显影响。像东莞和佛山放开全域限购后，短期来看，对楼市具有一定的刺激作用。</p><p>中原地产研究院数据显示，2023年东莞1月一手住宅成交14万平（1185套），同比下降19%；二手住宅过户1668套，同比上升62%。</p><p><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230207/167573170151466-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p>2022年12月9日，佛山出台解除全域限购令。克而瑞数据显示，2022年12月佛山一手住宅市场的成交量仅次于2022年6月，为2022年第二高。</p><p>邓浩志指出，“效果到目前为止有一点，但不是特别明显。其实从去年上半年开始，房地产市场就推出刺激政策了，但上半年就如‘犹抱琵琶半遮面’，都是一些很轻微的刺激政策。后续发现问题越来越严重，市场不断下滑，从去年下半年开始进入第二个阶段，就是加强刺激。到了去年四季度，二线城市普遍采取很强的刺激政策了，像东莞、佛山直接全面取消限购。所以，去年的上半年基本上没表现，下半年到年底，开始有一点点表现，这个跟一开始力度不强，也跟出台强刺激政策比较晚有关系，这是一个关键点。”</p><p>宋丁也认为，GDP过万亿元的城市松绑限购后，带来的刺激度是有限的。“即便放开限购之后，并不一定会出现人们想象中的蜂拥而至去买房（的局面），因为人们的买房欲望已经到了一个低点的位置，即不管限不限购，都不去买了。所以限购的政策就自动失效了，而其取消掉之后，可能也有人来买从而增加一点楼市活跃度。”</p><p>今年会继续加大楼市刺激力度吗？</p><p>值得一提的是，截至今年1月底，随着31个省（区、市）2023年政府工作报告出炉，不少省（区、市）定下了2023年经济增速目标，数值范围在4%至9.5%。然而2022年全国GDP增速仅有3%，这也意味着各地2023年GDP增长压力较大。</p><p>在这种压力背景下，各地会出台政策进一步刺激楼市吗？</p><p>对此，宋丁表示：“今年的经济增长，各个省市提出的目标超过5%，我认为非常正常，因为去年增长都很弱，主要是疫情的干扰，其实今年绝大多数省市只要正常操作，基本上轻松达到5%，就是因为去年基数太低了。”</p><p>同时，宋丁也提到，刺激楼市来促进经济增长这件事，在很多省市来讲是有相关动作的。但是即便是想通过刺激楼市来促进经济增长，也不一定完全能达到他们想象中的效果。</p><p>邓浩志也表示，“我认为后续可能还会继续出台刺激楼市政策。有统计数据显示，截至到1月31日，已有50省市（县）出台53条楼市刺激政策。各地也提到了今年要支持刚需、改善需求，所以今年肯定会（出台）更多（刺激楼市政策）。”</p><p>同时，邓浩志也提到，万亿元GDP城市已经出台解除楼市限购政策，现在关键是一线城市能不能出台相关刺激楼市的政策。“首先，北上广深四个一线城市，有接近1亿人口。虽然仅仅是四个城市，但是影响范围很大。其次，二、三、四线城市都是以一线城市作为参考指标。可能会出现一线城市低迷，二、三、四线城市的人就不敢买的情况，这里面存在着龙头示范效应。所以我认为一线城市（楼市限购政策）有可能会松绑。”</p><p>“当然我们现在也看到一线城市低迷，从刚刚过去的春节档期来看，二、三线城市表现比一线城市好，比方说广州表现不及佛山好，东莞、惠州的成交量也比深圳要大，活跃度更高。所以，一线城市现在也面临着客源、资金被分流到周边城市的情况。如果一线城市能够适当的放松，会对解决一线城市楼市低迷和带动二、三线城市有所帮助。”邓浩志说。</p><p><br/></p>'),(335817,'<blockquote class=\"bjh-blockquote\" style=\"margin: 0px; padding: 0px 0px 0px 30px; overflow-y: auto; max-width: 100%; position: relative; min-height: 24px; color: rgb(153, 153, 153);\"><p style=\"max-width: 100%; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">“无论你如何尝试改变方法，你的品位、你的习惯、你的思维模式、你的灵魂都会通过行动体现出来。”</p><p style=\"max-width: 100%; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br style=\"display: block; max-width: 100%;\"/></p><p style=\"max-width: 100%; line-height: 30px; color: rgb(34, 34, 34); margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">——英国作家阿加莎</p></blockquote><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">看过很多的理想家园后，不难发现很多屋主的诉求都是把自己居住的地方，装潢成“现实的避难所”、或者“宁静的乌托邦”。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><span style=\"max-width: 100%;\">下面分享的这个家。</span><strong style=\"max-width: 100%;\">女主人Sophie</strong><strong style=\"max-width: 100%;\">&nbsp;Warburton苏菲·沃伯顿</strong><strong style=\"max-width: 100%;\"><span style=\"max-width: 100%;\">是一个折衷</span>风格家居品牌<span style=\"max-width: 100%;\">创始人兼创意顾问。</span></strong><strong style=\"max-width: 100%;\">她的家位于伦敦一个维多利亚时代的老建筑内</strong><strong style=\"max-width: 100%;\">，</strong><span style=\"max-width: 100%;\">在保留建筑本身的历史特征外，她和丈夫用柔和的色彩，将这处老房子变成一个宁静的避风港。</span></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p class=\"template-1 color-FAA910\" data-bjh-box=\"template-header\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\"><span class=\"count\" style=\"display: block; width: 58px; height: 52px; font-size: 52px; line-height: 52px; opacity: 0.1; font-family: HelveticaNeue-Bold; font-weight: 700; color: rgb(250, 169, 16);\">01</span><span class=\"content\" contenteditable=\"false\" style=\"display: block; width: 319.609px; height: auto; font-size: 18px; font-family: PingFangSC-Medium; outline: none; position: relative; top: -15px; letter-spacing: 0.8px;\">客厅：传统布局里，注入现代时尚气息</span><span class=\"line\" style=\"display: block; width: 16px; height: 2px; margin-top: -3px; background: rgb(250, 169, 16);\"></span></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190339753-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190390451-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲客厅局部</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">本身这个家老式建筑的格局有自己鲜明的特点，比如维多利亚式凸窗、壁炉，这些原始的细节得以保留。而软装则更多是女主人喜欢的折衷主义，变得更加现代简约。比如棕色极简皮椅，美丽的丝绒绿复古沙发，还有素雅的地毯等。真正做到传统与经典平衡，又美感爆棚。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190337251-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190339480-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">客厅需要一个安静的角落思考、阅读、反思和放松。原木色书架和印花扶手椅，还有不锈钢花瓶等的整体结合，在现代与复古，时尚与乡村融合方面都是非常美观的。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p class=\"template-1 color-FAA910\" data-bjh-box=\"template-header\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\"><span class=\"count\" style=\"display: block; width: 58px; height: 52px; font-size: 52px; line-height: 52px; opacity: 0.1; font-family: HelveticaNeue-Bold; font-weight: 700; color: rgb(250, 169, 16);\">02</span><span class=\"content\" contenteditable=\"false\" style=\"display: block; width: 357.203px; height: auto; font-size: 18px; font-family: PingFangSC-Medium; outline: none; position: relative; top: -15px; letter-spacing: 0.8px;\">餐厨：现代便捷和审美中，寻求微妙的平衡</span><span class=\"line\" style=\"display: block; width: 16px; height: 2px; margin-top: -3px; background: rgb(250, 169, 16);\"></span></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190469308-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190428657-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲餐厅</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">拉到天花板的极简风定制柜，本身就会提高空间的高度，看起来大气很多。加上香槟金色调，更是气质得到提升。整体的家具都非常简约，线条感鲜明，越简单越是不凡。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190440007-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲餐厅细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">想要驱赶冷意，为家增添活力趣味，加点色彩吧。彩色条纹抱枕，挂画和彩色烛台等，色彩见证生活的多姿多彩。而将传统美学融合现代设计的超轻椅，那种轻盈的感觉与主人对极简生活方式的追求非常融合。功能与美学结合，这样才能达到视觉上的平衡。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190591115-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190588971-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190512019-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲厨房</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">绿色是一种拥有奇妙平静和自然感的色调，在每个家庭中都经常运用，而运用在厨房也令人惊叹。在这里，绿色调与白色调的搭配，具有简洁华丽的感觉，也令人觉得有趣不呆板。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p class=\"template-1 color-FAA910\" data-bjh-box=\"template-header\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\"><span class=\"count\" style=\"display: block; width: 58px; height: 52px; font-size: 52px; line-height: 52px; opacity: 0.1; font-family: HelveticaNeue-Bold; font-weight: 700; color: rgb(250, 169, 16);\">03</span><span class=\"content\" contenteditable=\"false\" style=\"display: block; width: 338.406px; height: auto; font-size: 18px; font-family: PingFangSC-Medium; outline: none; position: relative; top: -15px; letter-spacing: 0.8px;\">楼道：不放过边角，让家的活力充盈起来</span><span class=\"line\" style=\"display: block; width: 16px; height: 2px; margin-top: -3px; background: rgb(250, 169, 16);\"></span></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190559145-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲楼道细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">任何房子周围的书籍，都是展现主人性格和生活感受的一种方式。对于爱读书的人来说，这样利用楼道转角空间来存放书籍是一个非常美妙的主意，平日里路过看着也是一种美得享受。随手拿一本书坐下来阅读片刻，气氛到位了，才会自然而然去阅读。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190596380-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲角落</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">这是家里的一个小角落。也体现着整体的搭配灵感，古老的伦敦建筑，窗户小小的，利用白色的窗框和罗马帘的组合，既提亮角落光线也保持着英式的传统。而上世纪中期现代主义风格的办公椅，还有Hay家的折纸台灯，则又带来简欧的利落线条与现代时尚感。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p class=\"template-1 color-FAA910\" data-bjh-box=\"template-header\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\"><span class=\"count\" style=\"display: block; width: 58px; height: 52px; font-size: 52px; line-height: 52px; opacity: 0.1; font-family: HelveticaNeue-Bold; font-weight: 700; color: rgb(250, 169, 16);\">04</span><span class=\"content\" contenteditable=\"false\" style=\"display: block; width: 357.203px; height: auto; font-size: 18px; font-family: PingFangSC-Medium; outline: none; position: relative; top: -15px; letter-spacing: 0.8px;\">卧室：色彩纹理精心演绎，宁静柔媚的意境</span><span class=\"line\" style=\"display: block; width: 16px; height: 2px; margin-top: -3px; background: rgb(250, 169, 16);\"></span></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190526469-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190627879-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲主卧</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">南北通透的卧室当下已经难寻踪迹，透过窗户可以感受树木与自然。而室内也是一片生机盎然，窗帘上肆意伸展的植物图案，特别有格调的豆蔻绿墙面，搭配素净的酒店式床品，还有上世纪现代主义的经典灯具，简洁宁静令人心安。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190639654-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲主卧细节</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">角落一样迷人。台灯在这个家里也是重要的装饰品，白色陶瓷花朵雕饰的底座，特别有雅致瓷偶的艺术气质，配上布艺灯罩，灯光摇曳光彩照人。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190669661-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190628156-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲卧室二</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">英式元素里少不了乡村风的印花，繁复的花朵图案优雅又浓郁，而浅浅的粉色调，又让老房子变得更年轻，更有诗意。暗红的布艺床背以及手工布艺灯罩装饰的复古风台灯，配上烟灰色线条纤细的家具，新旧风格融合无比舒服。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576190617127-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">▲卧室三</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">英式的元素体现在普鲁士蓝的主色上，以及格纹等几何图案上。台灯和柜子则依然坚持简经典的MCN风，传统与现代的融合并不突兀，宁静蓝色中橘色沙发点缀，色彩搭配也非常吸睛。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">一个舒适宁静的家，少不了主人的极好品味，有热衷的风格或者收藏旅行的习惯。而这些内在，</strong><strong style=\"max-width: 100%;\">通过软装和</strong><strong style=\"max-width: 100%;\">色彩表达出来。这个家集温柔、舒适与优雅格调于一身，色彩淡雅又不冰冷。这种宽松的氛围，确实让人心动，远离尘嚣变为现实。</strong></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">如果你也喜欢这个</strong><strong style=\"max-width: 100%;\">新旧融合的家，</strong><strong style=\"max-width: 100%;\">就点赞收藏</strong><strong style=\"max-width: 100%;\">分享哦。相信审美是一种累积。</strong></p><p><br/></p>'),(335818,'<p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">日本夫妻住套内80㎡，之所以决定旧房重装，都是为了即将到来的小生命~</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">如今房子通风透气数月，真等搬进来的那一刻，感觉好像又是住进了新房，室内依旧整洁清爽，环形动线和大容纳储物，为以后的生活提供了更高的便利。<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576210988752-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><strong style=\"max-width: 100%;\">改造户型前后：</strong><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">室内动线更为流畅，借原有的客餐厅区域增设了一个小次卧，尤其家庭住宅至少有3间卧室才叫实用，方便长辈照看或留宿。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576210961309-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">入户适当下沉，局部高柜到顶，底部留空方便换放鞋，虽说有个过道，但对于他们来说并不算什么缺陷，适当增加一道室内门，保证了空间的相对独立性。<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">过道局部移门后是一间小卧室，孩子小的时候跟大人睡，等大点了就可以自己住了，卧室大多都集中在入户门以及过道附近，与室内动静分区明确，对面就是卫生间。<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576210922078-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576210938496-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576210990274-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">另外两间卧室大差不差，顶多就是面积大点，考虑到实用性，内部增加书桌，也能兼顾梳妆，没有什么多余的装饰，但住的确格外自在。<br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576210956793-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">经过过道的室内门，就到达了客餐厨区域，空间虽说有限，但开放式布局丝毫不显拥挤，经典的白色+原木色，配色简单舒适，就连家具都是普通款，却丝毫没觉得不好。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211091223-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">客厅大改小用，仅满足日常需求即可，舍弃茶几，让出更多的活动空间，考虑到高收纳的需求，借用电视墙，顶部增设了吊柜，无把手设计，美观性更好。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211034576-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">沙发后就是餐厨区域，借着厨房台面用餐桌进行延伸，增加可利用台面，燃气灶和水槽前适当抬高，平时做饭有点杂乱也不至于一览无余，也能避免溅油溅水等。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211064612-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211047977-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">双一字形厨房布局，闲置墙面设吊柜+地柜增容，同时充当了餐边柜的作用，局部适当留空定位卡槽+隔板，专门妥善安置各种小家电，想要拿取更为便利的，用抽板即可。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211095794-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211023816-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211086643-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">顺着过道往里走，隔着一道门，其后就是家政区+卫生间，打开后在室内形成了环形动线，省得绕远路，偶尔做饭时也能及时注意到洗衣机这块区域的情况。洗漱台外移，不要觉得不重要，偶尔洗点贴身衣物也方便。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211070587-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\">日本卫生间在干湿分离上格外讲究，马桶大多都是一个小单间，极大程度上避免了使用冲突，顶部设吊柜，虽说拿取不便，但日常屯点纸巾等还是相当实用的。</p><p style=\"overflow-y: auto; max-width: 100%; line-height: 30px; margin-top: 0px ; margin-bottom: 0px ; padding: 0px ;\"><br/></p><p><img src=\"//img.01fangyuan.com/upfile/news/20230207/167576211021517-17-0.jpg\" width=\"640\" class=\"_1mscr\" style=\"border: 0px; width: 656px; border-radius: 13px;\"/></p><p><br/></p>'),(335819,'<p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230207/167576334499672-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">促进住房消费成为各地稳经济的重要一环。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">近段时间，多个省市在提振2023年经济的会议和文件中，把住房消费提振纳入到新一年经济发展的框架之中，住房消费在2023年经济“拉动力”方面扮演更为重要的角色。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">广东省城规院住房政策研究中心首席研究员李宇嘉指出，从2022年下半年开始，国家对于房地产的基调有所调整，即从过去几年的“防风险、促转型、打造新模式”，开始转向“防风险、稳增长、促内需、打造新模式”。稳增长、促内需的权重上升了。在政策上，包括降低利率，房价下跌城市不设下限，退出或收缩行政干预政策，延长贷款集中度管理政策过渡期等，房企再融资开闸等“三支箭”发出。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">值得注意的是，经《华夏时报》记者统计，2022年全国（不含港、澳、台）GDP十强城市中，除了北上广深外，其余6个城市（重庆、苏州、成都、武汉、杭州、南京）去年均在一定程度上放开对楼市的限购。除此之外，像佛山、东莞等2022年GDP过万亿元的城市，则放开全域限购。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">诸葛找房数据研究中心高级分析师关荣雪认为，“预计后续还将会有更多热点二线城市跟进，预计除了一线城市外，其他城市或将全面取消限购。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">多个GDP过万亿元城市优化楼市政策</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">近日，随着各地陆续公布2022年经济运行数据，最新的全国（不含港、澳、台）GDP十强城市排名出炉，其十强分别是：上海、北京、深圳、重庆、广州、苏州、成都、武汉、杭州、南京。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">值得注意的是，经《华夏时报》记者观察，在2022年全国（不含港、澳、台）GDP十强城市中，除了北上广深四大一线城市外，其余6个城市在2022年均在一定程度上放开了对楼市的限购。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">以重庆为例。2022年12月28日，重庆多部门联合出台《关于进一步促进房地产市场平稳健康发展的通知》，明确提出激活市场有效需求，优化商贷住房套数认定，居民将存量房盘活用作保租房的，可不纳入家庭住房贷款套数计算，支持刚需，在渝生活、工作的非本地户籍的居民及成渝双城经济圈川籍居民享受同城待遇，加大货币化安置的力度、延长认购期支持家庭“先买新再卖旧”等。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">对此，克而瑞分析称，该项措施进一步降低了外地入渝居民、本地购房人群的买房门槛，扩大了购房人群，对合理改善需求给予支持；并且有助于盘活存量资产，进一步助力“租购并举”的多体系供给。同时，在成渝一体化发展驱动中，通过贷款政策同城化，扩大客群基底，加深双城联动。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">而GDP紧随广州的苏州，也在2022年4月放松了二手房限售、限购政策。具体来看，二手房限售时间由5年改为3年；在限购方面，非苏州户口购房由3年内连续满24个月社保改为累计24个月，同时外地人卖房后2年内，无需社保或税单可直接购房。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">值得一提的是，2022年9月14日，苏州对非本地户籍居民购房政策做出调整，外地人在苏州六区（吴中区、吴江区、姑苏区、相城区、高新区、工业园区）购买首套房无需开具社保证明或个人所得税证明，但只限购1套。不过，时隔仅一日，苏州便恢复2022年9月16日之前购房政策，即需要提供三年内连续6个月社保或个税证明。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">彼时，中指研究院指出，在中央坚持“房住不炒”定位的指导下，一二线城市政策优化的力度普遍偏弱，各地高频小步优化成为2022年以来房地产政策调整的一大特点。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">就如成都，2022年“高频小步”松绑限购范围，扩大购房人群。2022年12月30日，成都市房地产市场平稳健康发展领导小组办公室《关于进一步明确我市房地产调控政策有关规定的通知》提出，父母投靠成年子女入户的，可以作为单独家庭在户籍对应的限购区域购买一套住房。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">而在此前的11月17日，成都市房地产市场平稳健康发展领导小组办公室印发《关于进一步优化区域限购措施的通知》，优化区域限购措施。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">除此之外，武汉、杭州、南京2022年均在一定程度上放开了对楼市的限购。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">佛山、东莞“一次性放开”全域限购</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">相比于上述城市的“不断试探”，2022年GDP过万亿元的佛山和东莞则选择“一次性放开”。2022年12月9日，佛山市住房和城乡建设局印发了《佛山市住房和城乡建设局关于进一步优化房地产调控政策的通知》，明确指出：自2022年12月10日起，在本市禅城区祖庙街道、南海区桂城街道、顺德区大良街道暂停实施住房限购政策，但须自商品房买卖合同网签备案之日起满3年方可上市交易。该政策的发布，意味着佛山全域放开了限购。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">不久之后，东莞也跟上佛山的步伐，全域不再实行商品住房限购政策。2022年12月26日，东莞市住房和城乡建设局发布《关于进一步优化房地产调控政策的通知 (东建房[2022] 23号)》，确认从通知发布之日起，莞城街道、东城街道、南城街道、万江街道、松山湖高新技术产业开发区全面暂停实施商品住房限购政策。这意味着东莞坚持6年之久的限购政策全面取消。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">值得一提的是，2022年佛山和东莞的GDP分别为12698.39亿元和11200.32亿元，GDP排名位列广东21个地级市中的第三、第四名，仅次于深圳、广州。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">关荣雪曾在2022年12月26日就向《华夏时报》记者指出，东莞全面放开限购以及放松限售是深入落实因城施策的调整之举。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">2022年12月15日至16日，中央经济工作会议在北京举行。其中，中央经济工作会议提及，要因城施策，支持刚性和改善性住房需求，解决好新市民、青年人等住房问题，探索长租房市场建设。要坚持房子是用来住的、不是用来炒的定位，推动房地产业向新发展模式平稳过渡。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">国家高端智库研究员宋丁在2月5日接受《华夏时报》记者采访时表示，除一线城市外，其他城市放开限购是一个大的趋势。因为限购政策是当年供不应求时代的产物。在供不应求的情况下，如果不限制，房价就会上涨得厉害，所以该政策就一直保持着。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">“现在国家房地产的基本性发生了一个根本的逆转。在这个情况下，除了这两年的房企债务问题，即保交楼的问题，根本上的问题是供需关系发生逆转。也就是说现在楼市的需求，特别是那些二、三线GDP万亿元城市的需求在收缩，很多人都已经有房子了，买的人也没那么多。而且，随着整个楼市投资的增幅增长（减缓），这里面的机会也越来越少了，所以说买房的人越来越趋向平缓。这个时候还限购的意义就不大了。”宋丁说道。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">东莞市统计局数据显示，2022年东莞房地产开发投资下降7.9%。同时，克而瑞数据显示，2022年东莞楼市供应322万平，同比下降45%；成交267万平，同比下降43%。在二手房方面，其成交量延续低位态势，但在政策宽松力度加码下（限购限售政策的松绑、增值税免征年限缩减），有效刺激了下半年二手市场交易持续活跃，呈现企稳态势，复苏强度优于新房。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230207/167576334499939-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">关荣雪也对记者指出，“在东莞之前，西安、杭州、佛山等城市也调整了限购，说明新一轮需求端的纾困政策已经由热点新一线或二线城市率先开局，在当前房地产市场尚待加速修复的背景下，金融支持房地产政策要应出尽出、因城施策，充分发挥政策积极效应，预计后续还将会有更多热点二线城市跟进，预计除了一线城市外，其他城市或将全面取消限购。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">数据显示，西安、杭州、佛山2022年的GDP分别为1.15万亿元、1.88万亿元和1.27万亿元，三座城市的GDP均超万亿元。其中，佛山市人民政府门户网站公开的数据显示，2022年佛山房地产开发企业完成投资1956.52亿元，同比下降16.5%；其中住宅投资下降16.2%。分地区看，禅城区房地产开发投资同比下降1.0%，南海区下降26.3%，顺德区增长1.0%，三水区下降42.9%，高明区下降52.4%。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">地产经济学家邓浩志在2月5日向《华夏时报》记者指出，放开楼市限购，主要是因为楼市下行引发的问题多了，比方说，房企遇到资金问题、银行遇到业务增长的问题、购房者面临资产价格下跌、地方政府面临财政减少等等，牵一发而动全身，所以重振房地产，提升经济，解决一系列问题。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">成效如何？</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">那么，放松限购后对当地楼市有何影响？</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">据记者观察，从之前放松限购的城市来看，有些城市在放松限购后短期内当地楼市的成交量明显得到提振；而有些城市放松限购后，却没有带来明显影响。像东莞和佛山放开全域限购后，短期来看，对楼市具有一定的刺激作用。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">中原地产研究院数据显示，2023年东莞1月一手住宅成交14万平（1185套），同比下降19%；二手住宅过户1668套，同比上升62%。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><img class=\"content-picture\" src=\"//img.01fangyuan.com/upfile/news/20230207/167576334487242-17-0.jpg\" style=\"border: 0px none; vertical-align: middle; max-width: 100%; margin: 0.6em auto; display: block;\"/></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">2022年12月9日，佛山出台解除全域限购令。克而瑞数据显示，2022年12月佛山一手住宅市场的成交量仅次于2022年6月，为2022年第二高。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">邓浩志指出，“效果到目前为止有一点，但不是特别明显。其实从去年上半年开始，房地产市场就推出刺激政策了，但上半年就如‘犹抱琵琶半遮面’，都是一些很轻微的刺激政策。后续发现问题越来越严重，市场不断下滑，从去年下半年开始进入第二个阶段，就是加强刺激。到了去年四季度，二线城市普遍采取很强的刺激政策了，像东莞、佛山直接全面取消限购。所以，去年的上半年基本上没表现，下半年到年底，开始有一点点表现，这个跟一开始力度不强，也跟出台强刺激政策比较晚有关系，这是一个关键点。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">宋丁也认为，GDP过万亿元的城市松绑限购后，带来的刺激度是有限的。“即便放开限购之后，并不一定会出现人们想象中的蜂拥而至去买房（的局面），因为人们的买房欲望已经到了一个低点的位置，即不管限不限购，都不去买了。所以限购的政策就自动失效了，而其取消掉之后，可能也有人来买从而增加一点楼市活跃度。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">今年会继续加大楼市刺激力度吗？</span></p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">值得一提的是，截至今年1月底，随着31个省（区、市）2023年政府工作报告出炉，不少省（区、市）定下了2023年经济增速目标，数值范围在4%至9.5%。然而2022年全国GDP增速仅有3%，这也意味着各地2023年GDP增长压力较大。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">在这种压力背景下，各地会出台政策进一步刺激楼市吗？</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">对此，宋丁表示：“今年的经济增长，各个省市提出的目标超过5%，我认为非常正常，因为去年增长都很弱，主要是疫情的干扰，其实今年绝大多数省市只要正常操作，基本上轻松达到5%，就是因为去年基数太低了。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">同时，宋丁也提到，刺激楼市来促进经济增长这件事，在很多省市来讲是有相关动作的。但是即便是想通过刺激楼市来促进经济增长，也不一定完全能达到他们想象中的效果。</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">邓浩志也表示，“我认为后续可能还会继续出台刺激楼市政策。有统计数据显示，截至到1月31日，已有50省市（县）出台53条楼市刺激政策。各地也提到了今年要支持刚需、改善需求，所以今年肯定会（出台）更多（刺激楼市政策）。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">同时，邓浩志也提到，万亿元GDP城市已经出台解除楼市限购政策，现在关键是一线城市能不能出台相关刺激楼市的政策。“首先，北上广深四个一线城市，有接近1亿人口。虽然仅仅是四个城市，但是影响范围很大。其次，二、三、四线城市都是以一线城市作为参考指标。可能会出现一线城市低迷，二、三、四线城市的人就不敢买的情况，这里面存在着龙头示范效应。所以我认为一线城市（楼市限购政策）有可能会松绑。”</p><p class=\"one-p\" style=\"white-space: normal; margin-top: 0px; margin-bottom: 2em; padding: 0px; line-height: 2.2; overflow-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px;\">“当然我们现在也看到一线城市低迷，从刚刚过去的春节档期来看，二、三线城市表现比一线城市好，比方说广州表现不及佛山好，东莞、惠州的成交量也比深圳要大，活跃度更高。所以，一线城市现在也面临着客源、资金被分流到周边城市的情况。如果一线城市能够适当的放松，会对解决一线城市楼市低迷和带动二、三线城市有所帮助。”邓浩志说。</p><p><br/></p>'),(335820,'<p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; visibility: visible; box-sizing: border-box ;\">重点城市购房政策继续放宽。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; visibility: visible; box-sizing: border-box ;\">2月6日，湖北省武汉市发布16条稳经济措施，其中在稳楼市方面提出，动态调整住房限购范围，在住房限购区域增加一套购房资格，在非限购区域的住房不计入购房认定套数，外地人在限购区域购首套房可实行购房资格“承诺办、容缺办”。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; visibility: visible; box-sizing: border-box ;\">同日，黑龙江省哈尔滨市发布20条稳楼市新政，包括支持首套及第二套合理购房需求、购房补贴、公积金等政策。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">业内人士认为，武汉此次对限购政策灵活调整，意味着传统的“本地人限购两套、外地人限购一套”的规定调整为“本地人限购三套、外地人限购两套”，此次政策调整对于武汉市场和全国其他城市都有积极作用，值得全国各地学习。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\"><span style=\"margin: 0px; padding: 0px; outline: 0px; max-width: 100%; box-sizing: border-box ; overflow-wrap: break-word ; font-weight: bolder;\">武汉调整住房限购政策</span></p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">2月6日，武汉市发布《关于激发市场主体活力推动经济高质量发展的政策措施》，从强化供给侧保障、加快扩大有效需求、支持困难行业发展、推动企业加快发展等四方面提出16条措施。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">&nbsp;<img src=\"//img.01fangyuan.com/upfile/news/20230207/167576818968095-17-0.png\"/></p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">其中，在支持困难行业发展方面提出，在促进房地产市场平稳健康发展。支持居民家庭合理住房消费，结合房价和新房库存情况动态调整住房限购范围。在武汉市住房限购区域购房的居民家庭可新增一个购房资格，在非限购区域拥有的住房不计入居民家庭购房资格认定套数，非本市户籍居民家庭在限购区域购买首套住房的可实行购房资格“承诺办、容缺办”。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">对此，上海易居房地产研究院研究总监严跃进认为，此次武汉提出限购政策要动态调整的重要思路，明确要结合房价和新房库存的情况动态调整限购范围，该思路和此前央行建立首套住房贷款利率政策动态调整机制的思路是一致的，即基于市场行情做政策灵活调整。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">严跃进进一步指出，此次政策明确，限购区域增加一套购房资格、购房资格认定套数放宽、外地购房的购房资格从宽认定。这实际上使得本地人和外地人都增加了购房名额，尤其是限购区域无条件增加一套购房资格，意味着传统的“本地人限购两套、外地人限购一套”的规定调整为“本地人限购三套、外地人限购两套”。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">广东省城规院住房政策研究中心首席研究员李宇嘉也指出，此次政策另一个亮点就是，非户籍或新市民可以买两套了。武汉集中了全省新市民、外来人口的80%，也是稳定楼市的生力军，特别是在户籍住房基本饱和的情况下。而且，为了助力新市民置业，武汉加大政务办事效率提升，非本市户籍居民家庭在限购区域购买首套住房的可实行购房资格“承诺办、容缺办”。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">对于武汉放宽限购的原因，李宇嘉认为，作为热点二线城市，武汉前几年供地面积、成交量一直在全国前三，但去年以来市场快速下行，2022年新建商品房交易下滑了40.3%，房价下跌比较明显，70城房价指数中，武汉连跌16个月，同比跌幅也居前。同时，武汉库存积压也比较重，包括潜在未开发、未售库存。因此，此次松绑可谓事出有因，即结合房价和新房库存情况，算是“因城施策”、“因时施策”。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">严跃进还认为，武汉购房政策具有标杆性，是降首付、降利率的双降政策后，又一种购房政策的思路和模式。双降政策属于金融政策，而限购政策调整属于行政政策。此次行政政策调整对于武汉市场和全国其他城市都有积极作用。此类做法值得全国各地的学习，尤其是要从“以旧换新”、“以小换大”、“多孩家庭”等住房改善的角度出发，优化限购区域的政策，促进住房消费市场的提振。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\"><span style=\"margin: 0px; padding: 0px; outline: 0px; max-width: 100%; box-sizing: border-box ; overflow-wrap: break-word ; font-weight: bolder;\">哈尔滨发布20条稳楼市新政</span></p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">2月6日，哈尔滨市发布《关于进一步促进哈尔滨市房地产市场平稳健康发展的若干措施》，涵盖了支持首套及第二套合理购房需求、购房补贴、公积金、土地规划、宣传推广、金融扶持等方面共20条政策措施。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\"><span style=\"margin: 0px; padding: 0px; outline: 0px; max-width: 100%; box-sizing: border-box ; overflow-wrap: break-word ; font-weight: bolder;\">在支持合理住房需求方面：</span></p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">一是多孩家庭、非哈市户籍居民、人才购买新建商品住宅享受相应补贴政策，其中，多孩家庭在主城9区购首套或第二套新房，分别给予1.5万元、2万元的一次性购房补贴；非哈市户籍的个人给予1万元一次性购房补贴；各类人才按照博士毕业生10万元、硕士毕业生5万元、本科毕业生及大中专毕业生3万元的标准给予一次性购房补贴。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">二是房展会期间购买新建商品住宅享受补贴政策，按实际购房款的1%给予购房补贴。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">三是单位或个人在主城9区内购买新建非住宅商品房（商业、办公、公寓）享受补贴政策，按实际购房款的3%给予购房补贴。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">四是农业户籍的购房人、教师、退役军人购买新建商品住宅享受相应补贴政策，给予3万元一次性购房补贴。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">五是进一步提升公积金使用灵活度，单职工贷款最高额度由50万元提高至60万元，双职工贷款最高额度由70万元提高至80万元。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">六是居住用途的公寓房屋，水、电收费继续执行民用价格标准。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; clear: both; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">对于出台稳楼市新政的原因，哈尔滨市政府表示，为深入贯彻落实国家关于房地产市场调控“一城一策、因城施策”工作要求，进一步完善哈尔滨市房地产市场调控机制，促进房地产市场平稳健康发展，支持住房合理需求，强化助企纾困措施，优化房地产市场环境，实现稳地价、稳房价、稳预期目标。</p><p style=\"margin-top: 0px; margin-bottom: 2em; padding: 0px; outline: 0px; max-width: 100%; overflow-wrap: break-word; min-height: 1em; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 2.2; font-family: &quot;Microsoft Yahei&quot;, Avenir, &quot;Segoe UI&quot;, &quot;Hiragino Sans GB&quot;, STHeiti, &quot;Microsoft Sans Serif&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; box-sizing: border-box ;\">对于与以前政策措施相比的变化，哈尔滨市政府表示，一是对人才购房加大政策支持，将年龄由原来的35周岁扩大至40周岁，并且没有户籍限制，更多留哈人才将受益。二是进一步扩大购房补贴政策受益范围，增加农业户籍的购房人、教师、退役军人购买新建商品住宅享受相应补贴政策。三是首次提出单位或个人在主城9区内购买新建非住宅商品房（商业、办公、公寓）享受补贴政策。四是采取“房票”安置补偿方式以及政府回购企业存量商品住宅筹集保障性租赁住房等方式，为进一步去库存，保障安置居民利益，提高保障性租赁住房品质做出有益探索。五是提出了引导在哈金融机构加大房地产领域信贷投放、进一步盘活低效国有资产，探索组建哈尔滨市房地产发展基金等，助力房地产平稳健康发展。</p>');
/*!40000 ALTER TABLE `fke_news_extend` ENABLE KEYS */;
