DROP TABLE IF EXISTS `fke_news_pic`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fke_news_pic` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `news_id` int(11) unsigned DEFAULT '0',
  `mid` int(10) unsigned DEFAULT '0',
  `pic_url` varchar(100) DEFAULT '',
  `add_time` int(11) unsigned DEFAULT '0',
  `is_check` tinyint(4) DEFAULT '0' COMMENT '0待审 1审核通过 -1审核失败',
  `is_main` tinyint(4) DEFAULT '0' COMMENT '是否是主图',
  `is_collect` tinyint(4) DEFAULT '0' COMMENT '0普通 1采集',
  `admin_id` int(11) unsigned DEFAULT '0',
  `admin_name` varchar(20) DEFAULT '',
  `check_time` int(11) unsigned DEFAULT '0' COMMENT '审核时间',
  `is_uploaded` tinyint(4) DEFAULT '0',
  `is_delete` tinyint(4) DEFAULT '0' COMMENT '图片是否已删除',
  `website_id` tinyint(3) unsigned DEFAULT '0' COMMENT '0采集 其它数字为站点儿ID',
  `rand_news_id` int(10) unsigned DEFAULT '0' COMMENT '图片上传时临时随机ID编号',
  PRIMARY KEY (`id`),
  KEY `check_time` (`check_time`),
  KEY `news_id` (`news_id`) USING BTREE,
  KEY `is_check` (`is_check`),
  KEY `mid` (`mid`),
  KEY `is_delete` (`is_delete`) USING BTREE,
  KEY `add_time` (`add_time`),
  KEY `website_id` (`website_id`),
  KEY `rand_news_id` (`rand_news_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2336 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

