iaoIcon icon\'></i>                            </span>                        <p class=\'pic-desc-word\'>扬名中心小学！地理位置好！楼层佳！曹张新村房龄新的房子！房子满五唯一，房型正，全部明窗，双层烧制钢瓦顶！小区内环境优美，有物业开门，干净整洁，有专用汽车停车位！！电瓶车自行车有专人看管车库，可以充电！</p>'),(263128,'','http://cq.58.com/ershoufang/38980446274457x.shtml?utm_source=&spm=',0,'','','','<span class=\'pic-desc-item\'>                                核心卖点<i class=\'sanjiaoIcon icon\'></i>                            </span>                        <p class=\'pic-desc-word\'>环湖雅居B区，单间，物管费，停车费，终身免费，房产证在手随时过户，房东自己卖，不要中介费，只接受全款，一手交钱一手过户</p>'),(263129,'','http://cq.58.com/ershoufang/38726724774164x.shtml?utm_source=&spm=',0,'','','','<span class=\'pic-desc-item\'>                                核心卖点<i class=\'sanjiaoIcon icon\'></i>                            </span>                        <p class=\'pic-desc-word\'>证在银行，差40万左右，客户解押，看房提前电话。</p>'),(263130,'','http://cq.58.com/ershoufang/38905389500169x.shtml?utm_source=&spm=',0,'','','','<span class=\'pic-desc-item\'>                                核心卖点<i class=\'sanjiaoIcon icon\'></i>                            </span>                        <p class=\'pic-desc-word\'>位于位于九龙坡杨公桥的三室两厅一厨一卫，小区中心有900多平的草地，还有篮球场游泳池，还有一些小朋友的游乐设施这些，附近有彩云小学和其小学的指标，还是划片到杨家坪中学，距离红狮大道车站50米，可乘坐405.807到沙坪坝和杨家坪商圈</p>');
