INSERT INTO `fke_qiuzu_extend` VALUES (1475550,'','http://cs.ganji.com/fang2/3599395729x.htm',0,'','','','曾承杰正在找【开福-马厂】的房子'),(1475551,'','http://cs.ganji.com/fang2/3590788623x.htm',0,'','','','中介忽扰，本人爱干净，希望可以养狗，希望是在望城正荣财富中心附近'),(1475552,'','http://cs.ganji.com/fang2/3589961922x.htm',0,'','','','李子木正在找【雨花-时代阳光大道】的房子'),(1475553,'','http://cs.ganji.com/fang2/3596345185x.htm',0,'','','','精装修。电梯房。家电家具齐全。可做饭'),(1475554,'','http://cs.ganji.com/fang2/3594322402x.htm',0,'','','','我是一名96年的单身小姐姐，性格外向，好相处，希望我的合租室友好相处就行'),(1475555,'','http://cs.ganji.com/fang2/3587276704x.htm',0,'','','','刘子航正在找【岳麓-洋湖湿地公园】的房子'),(1475556,'','http://cs.ganji.com/fang2/3578865939x.htm',0,'','','','按客服的要求顾心为客服服务，为顾客提供一个安全舒适的环境'),(1475557,'','http://cs.ganji.com/fang2/3584610397x.htm',0,'','','','丫头正在找【星沙-星沙片区】的房子'),(1475558,'','http://cs.ganji.com/fang2/3665673245x.htm',0,'','','','有时候女友会来玩，希望不要介意，'),(1475559,'','http://cs.ganji.com/fang2/3574433871x.htm',0,'','','','希望能接受我每天晚上十一点多还在鬼叫哈哈哈哈...'),(1475560,'','http://cs.ganji.com/fang2/3574132452x.htm',0,'','','','求租房，电梯房，方便打的坐车，可以做饭。'),(1475561,'','http://cs.ganji.com/fang2/3573044064x.htm',0,'','','','本人干净，除了上班下班就回去住一住，不乱带人回去，不吵闹，很安静，作息正常，学生党的年龄。'),(1475562,'','http://cs.ganji.com/fang2/3572241420x.htm',0,'','','','需要押一付一。头两个月比较拮据。后面可以调整。'),(1475563,'','http://cs.ganji.com/fang2/3579931129x.htm',0,'','','','啊奥正在找【雨花-井湾子】的房子'),(1475564,'','http://cs.ganji.com/fang2/3659376821x.htm',0,'','','','邬宇环正在找【雨花-高桥】的房子'),(1475565,'','http://cs.ganji.com/fang2/3565505667x.htm',0,'','','','合租的室友不要太懒，注意卫生就好'),(1475566,'','http://cs.ganji.com/fang2/3656033798x.htm',0,'','','','周先生正在找【芙蓉-张公岭】的房子'),(1477260,'','http://test.com/PageUrl.html',0,'','','','精装修，花园路与农业路附近，交通方便办公用，三百平米左右，布局要合理，价格不高于一万');
